INSERT INTO `email_template` VALUES ('15bf6fd1-e439-46dd-8198-aaae20aeb0f6',NULL,'49754753-d05d-4268-96c6-55e486c4d39d','2025-06-17 02:45:05.326000','2025-07-07 07:38:28.000000',NULL,'Mời phỏng vấn','Thư mời phỏng vấn vị trí [Tên Vị Trí] tại Sen Vàng Việt Nam','<p style=\"text-align:justify;\"><span style=\"color:#222222;\">Dear <strong>[Tên ứng viên],</strong></span></p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Lời đầu tiên, Công ty TNHH MTV Sen Vàng Việt Nam xin cảm ơn Bạn vì đã quan tâm đến vị trí tuyển dụng của công ty chúng tôi. Sau khi xem xét kỹ lưỡng, chúng tôi nhận thấy Bạn là một trong những người phù hợp với tiêu chí của vị trí&nbsp;<strong>[Tên vị trí]&nbsp;</strong>mà chúng tôi đang tuyển.</span></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Vì thế, để có thể trao đổi kỹ hơn về chi tiết công việc, cũng như tìm hiểu sâu hơn về kỹ năng chuyên môn của Bạn. Chúng tôi trân trọng kính&nbsp;mời&nbsp;Bạn đến tham gia buổi&nbsp;phỏng&nbsp;vấn&nbsp;tại:</span></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Địa chỉ:&nbsp;<strong>Số 200 Nguyễn Văn Bá, P. Trường Thọ, TP. Thủ Đức, TP. HCM</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Định vị:<i>&nbsp;</i></span><a href=\"https://maps.app.goo.gl/aPsi4b4PkoMw9SzVA\"><span style=\"color:#1155CC;\"><i>https://maps.app.goo.gl/aPsi4b4PkoMw9SzVA</i></span></a></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Thời gian:<strong>&nbsp;10:00 Thứ Năm, ngày 05/06/2025</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\"><strong>Để buổi&nbsp;phỏng&nbsp;vấn&nbsp;diễn ra thuận lợi.&nbsp;Bạn vui lòng hoàn thành&nbsp;</strong></span><span style=\"color:red;\"><strong>Mẫu Thông tin ứng viên</strong></span><span style=\"color:#222222;\"><strong>&nbsp;</strong></span><span style=\"color:red;\"><i><strong>(File đính kèm)&nbsp;</strong></i></span><span style=\"color:#222222;\"><strong>và&nbsp;phản hồi lại email này kèm Mẫu Thông tin ứng viên sớm nhất ngay khi nhận được.&nbsp;</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:#222222;\"><strong>Ghi chú: Khi Cổng gặp Bảo vệ, Bạn vui lòng báo&nbsp;vị trí&nbsp;Phỏng&nbsp;vấn&nbsp;và làm theo hướng dẫn nhé.</strong></span></p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><span style=\"color:#222222;\">Chúc Bạn may mắn trong buổi&nbsp;phỏng&nbsp;vấn&nbsp;sắp tới.</span></p><p style=\"text-align:justify;\">&nbsp;</p><p><span style=\"color:red;\"><strong>Tìm hiểu thêm về công ty:</strong></span></p><p><span style=\"color:red;\"><strong>Website:&nbsp;</strong></span><a href=\"https://sevago.jewelry/\"><span style=\"color:blue;\">https://sevago.jewelry/</span></a></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Facebook:&nbsp;</strong></span><a href=\"https://www.facebook.com/TuyendungSenvangVietnam/\"><span style=\"color:blue;\">https://www.facebook.com/TuyendungSenvangVietnam/</span></a></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Tiktok:&nbsp;</strong></span><a href=\"https://www.tiktok.com/@tuyendungsenvangvietnam\"><span style=\"color:blue;\">https://www.tiktok.com/@tuyendungsenvangvietnam</span></a><span style=\"color:blue;\"><u>/</u></span></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Linkedin:&nbsp;</strong></span><a href=\"https://www.linkedin.com/company/tuy%E1%BB%83n-d%E1%BB%A5ng-sen-v%C3%A0ng-vi%E1%BB%87t-nam-trang-suc\"><span style=\"color:blue;\">https://www.linkedin.com/company/tuyển-dụng-sen-vàng-việt-nam-trang-suc</span></a><span style=\"color:blue;\"><u>/</u></span></p><p style=\"text-align:justify;\">&nbsp;</p><p><span style=\"color:rgb(136,136,136);font-family:Arial, Helvetica, sans-serif;\">--</span></p><p><i>Thanks &amp; Best Regard,</i></p><p><span style=\"color:rgb(53,28,117);\">HR Department | Sen Vàng Việt Nam</span><br>&