 tôi rất trân trọng sự chuẩn bị kỹ lưỡng của bạn cũng như sự chủ động trong việc tìm hiểu về công ty và vị trí ứng tuyển. Hiện tại, chúng tôi đang tiến hành xem xét hồ sơ một cách cẩn trọng để đưa ra đánh giá phù hợp nhất.<br><br>Chúng tôi sẽ liên hệ với bạn trong thời gian sớm nhất ngay khi hồ sơ của bạn phù hợp với yêu cầu tuyển dụng.<br><br>Một lần nữa, cảm ơn bạn đã đồng hành cùng Sen Vàng Việt Nam.<br>Chúc bạn một ngày thật tích cực và nhiều năng lượng!</p><p><br><span style=\"color:red;\"><strong>Tìm hiểu thêm về công ty:</strong></span></p><p><span style=\"color:red;\"><strong>Website:&nbsp;</strong></span><a href=\"https://sevago.jewelry/\"><span style=\"color:blue;\">https://sevago.jewelry/</span></a></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Facebook:&nbsp;</strong></span><a href=\"https://www.facebook.com/TuyendungSenvangVietnam/\"><span style=\"color:blue;\">https://www.facebook.com/TuyendungSenvangVietnam/</span></a></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Tiktok:&nbsp;</strong></span><a href=\"https://www.tiktok.com/@tuyendungsenvangvietnam\"><span style=\"color:blue;\">https://www.tiktok.com/@tuyendungsenvangvietnam</span></a><span style=\"color:blue;\"><u>/</u></span></p><p style=\"text-align:justify;\"><span style=\"color:red;\"><strong>Linkedin:&nbsp;</strong></span><a href=\"https://www.linkedin.com/company/tuy%E1%BB%83n-d%E1%BB%A5ng-sen-v%C3%A0ng-vi%E1%BB%87t-nam-trang-suc\"><span style=\"color:blue;\">https://www.linkedin.com/company/tuyển-dụng-sen-vàng-việt-nam-trang-suc</span></a><span style=\"color:blue;\"><u>/</u></span></p><p style=\"text-align:justify;\">&nbsp;</p><p><span style=\"color:rgb(136,136,136);font-family:Arial, Helvetica, sans-serif;\">--</span></p><p><i>Thanks &amp; Best Regard,</i></p><p><span style=\"color:rgb(53,28,117);\">HR Department | Sen Vàng Việt Nam</span><br>&nbsp;</p><p><img class=\"image_resized\" style=\"width:10.45%;\" src=\"https://ci3.googleusercontent