INSERT INTO `job` VALUES ('0ef0a5d9-09f9-4bd1-b6ba-3513bcb12563','664cbb3f-5bcb-460f-8532-aac98c9bd340',NULL,'2025-08-02 06:36:27.695658','2025-08-02 06:36:49.000000','2025-08-02 06:36:49.000000','IT Helpdesk','Mới','Chờ phê duyệt',NULL,'<td><ul><li>Mô tả công việc</li></ul></td>','<td><ul><li>Tốt nghiệp cao đẳng/đại học </li><li><strong>Văn phòng làm việc:</strong> 200 Nguyễn Văn Bá, Phường Trường Thọ, Tp. Thủ Đức, TP. HCM</li></ul></td>','<td colspan=\"2\"><ul><li>Môi trường làm việc hiện đại, chuyên nghiệp, năng động, thân thiện, nhiều điều kiện, học hỏi và thăng tiến</li><li>Thời gian làm việc: 7h45 đến 16h45, từ thứ 2 - thứ 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa. </li><li>Thưởng chuyên cần 800.000 đồng/tháng. </li></ul></td>',2,2,0,0,0,0,'Toàn thời gian',2,2,'2025-08-01 23:26:17','Bình thường','[{\"url\": \"https://dev.office.sevago.local/upload/JD-Template%20(1).docx\", \"name\": \"JD-Template (1).docx\"}]','872f4e98-3894-48ca-aebf-8cfda81c196d',NULL,'f9374544-9491-44a9-bb71-502757dc03f0',NULL,NULL,NULL,'05cf0cfb-27ba-48ed-bc03-dc0615da8a25','Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh','Tuyển mới','','09a45f3f-59a2-4d15-8c49-b31be10c49b8',0,NULL,NULL,0,'Office Sevago',2,2),('24b6aed5-eef6-4cd7-8256-ed3c28930172','664cbb3f-5bcb-460f-8532-aac98c9bd340',NULL,'2025-08-08 03:37:18.394400','2025-08-08 04:05:40.000000',NULL,'Trưởng phòng phân tích nghiệp vụ','Tuyển gấp','Hoàn tất','2025-08-29 20:11:51','<ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js.</li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next.js.</li><li>Có khả năng xây dựng giao diện người dùng (UI) động, mạnh mẽ và đáp ứng (Responsive) cho ứng dụng.</li><li>Tham gia vào tất cả các khâu của sản phẩm bao gồm thiết kế, kiểm thử (Tester), phân tích nghiệp vụ (BA), nghiên cứu công nghệ mới để cải tiến chất lượng sản phẩm.</li><li>Thực hiện các báo cáo theo yêu cầu.</li><li>Thực hiện những nhiệm vụ khác được giao bởi cấp quản lý trực tiếp và Ban Giám đốc</li></ul>','<ul><li>Tốt nghiệp cao đẳng/đại học chuyên ngành Công nghệ thông tin, Khoa học máy tính, hoặc các ngành liên quan.</li><li>Có thể sử dụng TypeScript.</li><li>Sử dụng thành thạo Figma và triển khai Frontend.</li><li>Có kinh nghiệm xây dựng website sử dụng HTML, CSS, JavaScript.</li><li>Có kinh nghiệm với các framework như Bootstrap, Material UI, Ant Design, Tailwind CSS.</li><li>Sử dụng thành thạo React.js và Next.js.</li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub.</li><li>Biết sử dụng Firebase và Socket.io.</li><li>Kinh nghiệm làm việc với Redux Toolkit.</li><li>Thành thạo các công cụ quản lý mã nguồn: GIT.</li><li>Có hiểu biết về thiết kế hệ thống, tối ưu và nâng cao hiệu năng, độ ổn định.</li><li>Tư duy mở, sẵn sàng học và tìm hiểu các công nghệ mới. Có trách nhiệm với công việc.</li><li>Phong cách làm việc chỉn chu, cẩn thận, tỉ mỉ, chuyên nghiệp. Có sức khỏe và chịu áp lực công việc tốt.</li><li>Giới tính: Nam/Nữ; Tuổi: dưới 35 tuổi.</li><li><strong>Văn phòng làm việc:</strong> 200 Nguyễn Văn Bá, Phường Trường Thọ, Tp. Thủ Đức, TP. HCM</li></ul>','<p>aaaaa</p>',10000000,20000000,1,1,1,1,'Toàn thời gian',2,1,'2025-08-29 20:11:51','Gấp','[{\"url\": \"https://dev.office.sevago.local/upload/SenV%C3%A0ng-JD-Front-end%20Developer%201%20.docx\", \"name\": \"SenVàng-JD-Front-end Developer 1 .docx\"}]','8e7dcc36-5e7a-4bbe-87ab-17d07c858324','0a3ccdd7-cf08-4529-86a6-cbc76dfb0c9e','f7a328b4-02d0-4520-83b4-4d5a6b61a938',NULL,NULL,'0cd931e2-9d88-48b5-a6ee-646b6a55b964','e51414d2-e43e-49f6-bbe8-70bb5703c3a3','Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh','Tuyển mới','','5f51dde1-37b9-4f58-bf8c-84c2f7afcc5a',1,'2025-08-07 20:55:32','2025-08-07 21:05:40',0,'Office Sevago',10000000,20000000),('73eac830-0673-4d7e-9dd6-4c7cf634316a','63fc4397-ec0e-43ae-81ad-2e36229f94a5',NULL,'2025-08-07 03:31:08.863094','2025-08-08 02:42:28.000000',NULL,'Trưởng phòng phát triển phần mềm','Tuyển gấp','Đang tuyển','2025-08-06 18:36:38','<ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js.</li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next.js.</li><li>Có khả năng xây dựng giao diện người dùng (UI) động, mạnh mẽ và đáp ứng (Responsive) cho ứng dụng.</li><li>Tham gia vào tất cả các khâu của sản phẩm bao gồm thiết kế, kiểm thử (Tester), phân tích nghiệp vụ (BA), nghiên cứu công nghệ mới để cải tiến chất lượng sản phẩm.</li><li>Thực hiện các báo cáo theo yêu cầu.</li><li>Thực hiện những nhiệm vụ khác được giao bởi cấp quản lý trực tiếp và Ban Giám đốc</li></ul>','<ul><li>Tốt nghiệp cao đẳng/đại học chuyên ngành Công nghệ thông tin, Khoa học máy tính, hoặc các ngành liên quan.</li><li>Có thể sử dụng TypeScript.</li><li>Sử dụng thành thạo Figma và triển khai Frontend.</li><li>Có kinh nghiệm xây dựng website sử dụng HTML, CSS, JavaScript.</li><li>Có kinh nghiệm với các framework như Bootstrap, Material UI, Ant Design, Tailwind CSS.</li><li>Sử dụng thành thạo React.js và Next.js.</li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub.</li><li>Biết sử dụng Firebase và Socket.io.</li><li>Kinh nghiệm làm việc với Redux Toolkit.</li><li>Thành thạo các công cụ quản lý mã nguồn: GIT.</li><li>Có hiểu biết về thiết kế hệ thống, tối ưu và nâng cao hiệu năng, độ ổn định.</li><li>Tư duy mở, sẵn sàng học và tìm hiểu các công nghệ mới. Có trách nhiệm với công việc.</li><li>Phong cách làm việc chỉn chu, cẩn thận, tỉ mỉ, chuyên nghiệp. Có sức khỏe và chịu áp lực công việc tốt.</li><li>Giới tính: Nam/Nữ; Tuổi: dưới 35 tuổi.</li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub.</li><li><strong>Văn phòng làm việc:</strong> 200 Nguyễn Văn Bá, Phường Trường Thọ, Tp. Thủ Đức, TP. HCM</li></ul>','<ul><li>Môi trường làm việc hiện đại, chuyên nghiệp, năng động, thân thiện, nhiều điều kiện, học hỏi và thăng tiến</li><li>Thời gian làm việc: 7h45 đến 16h45, từ thứ 2 - thứ 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa.</li><li>Thưởng chuyên cần 800.000 đồng/tháng.</li><li>Được hưởng các chế độ dành cho người lao động theo quy định pháp luật hiện hành (nghỉ phép, lễ, tết,…).</li><li>Được hưởng các chính sách phúc lợi theo quy định của Công ty: sinh nhật cá nhân, cưới hỏi, thăm hỏi ốm đau, du lịch nghỉ mát, khám sức khỏe định kỳ hằng năm.</li><li>Tham gia đầy đủ BHYT, BHXH, BHTN theo quy định và các quyền lợi khác theo quy định của luật lao động.</li><li>Công ty có chính sách đầu tư đào tạo và nâng cao kỹ năng nhân sự nắm giữ vị trí quản lý trong tương lai.</li></ul>',20000000,30000000,0,0,0,0,'Toàn thời gian',5,1,'2025-08-06 18:36:38','Gấp','[{\"url\": \"https://dev.office.sevago.local/upload/JD-Front-end-Dev%20(1).docx\", \"name\": \"JD-Front-end-Dev (1).docx\"}]','ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f','0a3ccdd7-cf08-4529-86a6-cbc76dfb0c9e','f7a328b4-02d0-4520-83b4-4d5a6b61a938',NULL,NULL,'45839203-ac57-4fe7-8d14-7a8a80d1acdc','11351ee0-87cb-4b05-91a8-9fffb879f44e','Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh','Tuyển mới','','8616f141-9a90-4537-8994-9fb5db514048',0,'2025-08-07 19:42:23',NULL,0,'Office Sevago',20000000,30000000),('a70ebc9a-cb55-4460-ba1d-8b80bfe6057a','664cbb3f-5bcb-460f-8532-aac98c9bd340',NULL,'2025-08-08 03:35:11.344762','2025-08-08 03:35:11.344762',NULL,'Trưởng bộ phận phân tích nghiệp vụ & Dữ liệu','Mới','Chờ phê duyệt',NULL,'<td><ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js. </li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next.js. </li><li>Có khả năng xây dựng giao diện người dùng (UI) động, mạnh mẽ và đáp ứng (Responsive) cho ứng dụng. </li><li>Tham gia vào tất cả các khâu của sản phẩm bao gồm thiết kế, kiểm thử (Tester), phân tích nghiệp vụ (BA), nghiên cứu công nghệ mới để cải tiến chất lượng sản phẩm. </li><li>Thực hiện các báo cáo theo yê