g việc.</li><li>Phong cách làm việc chỉn chu, cẩn thận, tỉ mỉ, chuyên nghiệp. Có sức khỏe và chịu áp lực công việc tốt.</li><li>Giới tính: Nam/Nữ; Tuổi: dưới 35 tuổi.</li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub.</li><li><strong>Văn phòng làm việc:</strong> 200 Nguyễn Văn Bá, Phường Trường Thọ, Tp. Thủ Đức, TP. HCM</li></ul>','<ul><li>Môi trường làm việc hiện đại, chuyên nghiệp, năng động, thân thiện, nhiều điều kiện, học hỏi và thăng tiến</li><li>Thời gian làm việc: 7h45 đến 16h45, từ thứ 2 - thứ 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa.</li><li>Thưởng chuyên cần 800.000 đồng/tháng.</li><li>Được hưởng các chế độ dành cho người lao động theo quy định pháp luật hiện hành (nghỉ phép, lễ, tết,…).</li><li>Được hưởng các chính sách phúc lợi theo quy định của Công ty: sinh nhật cá nhân, cưới hỏi, thăm hỏi ốm đau, du lịch nghỉ mát, khám sức khỏe định kỳ hằng năm.</li><li>Tham gia đầy đủ BHYT, BHXH, BHTN theo quy định và các quyền lợi khác theo quy định của luật lao động.</li><li>Công ty có chính sách đầu tư đào tạo và nâng cao kỹ năng nhân sự nắm giữ vị trí quản lý trong tương lai.</li></ul>',10000000,20000000,1,1,1,1,'Toàn thời gian',1,1,'2025-08-06 20:00:10','Bình thường','[{\"url\": \"https://dev.office.sevago.local/upload/JD-Front-end-Dev.docx\", \"name\": \"JD-Front-end-Dev.docx\"}]','ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f','0a3ccdd7-cf08-4529-86a6-cbc76dfb0c9e','f9374544-9491-44a9-bb71-502757dc03f0',NULL,NULL,'45839203-ac57-4fe7-8d14-7a8a80d1acdc','77f6b26f-1e11-4228-838b-42b56c15950f','Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh','Tuyển mới','','692c4a07-444f-4971-addf-6a89b1eea701',1,'2025-08-06 20:37:50','2025-08-06 20:59:36',0,'Office Sevago',10000000,20000000);
