INSERT INTO `job_log` VALUES ('0ff163e4-df4f-4815-b08e-fc6d59fe17e9','664cbb3f-5bcb-460f-8532-aac98c9bd340',NULL,'2025-08-02 06:36:49.179747','2025-08-02 06:36:49.179747',NULL,'Xóa','Yêu cầu tuyển dụng',NULL,NULL,NULL,'0ef0a5d9-09f9-4bd1-b6ba-3513bcb12563'),('1685fe97-ca7d-4866-877b-711e38e42562','45839203-ac57-4fe7-8d14-7a8a80d1acdc',NULL,'2025-08-08 02:42:23.820870','2025-08-08 02:42:23.820870',NULL,'Đăng tuyển','Công việc','{\"id\": \"73eac830-0673-4d7e-9dd6-4c7cf634316a\", \"tag\": \"Tuyển gấp\", \"name\": \"Trưởng phòng phát triển phần mềm\", \"note\": \"\", \"type\": \"Toàn thời gian\", \"budget\": 0, \"status\": \"Được phê duyệt\", \"address\": \"Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh\", \"ownerId\": null, \"welfare\": \"<td colspan=\\\"2\\\"><ul><li>Môi trường làm việc hiện đại, chuyên nghiệp, năng động, thân thiện, nhiều điều kiện, học hỏi và thăng tiến</li><li>Thời gian làm việc: 7h45 đến 16h45, từ thứ 2 - thứ 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa. </li><li>Thưởng chuyên cần 800.000 đồng/tháng.</li><li>Được hưởng các chế độ dành cho người lao động theo quy định pháp luật hiện hành (nghỉ phép, lễ, tết,…).</li><li>Được hưởng các chính sách phúc lợi theo quy định của Công ty: sinh nhật cá nhân, cưới hỏi, thăm hỏi ốm đau, du lịch nghỉ mát, khám sức khỏe định kỳ hằng năm.</li><li>Tham gia đầy đủ BHYT, BHXH, BHTN theo quy định và các quyền lợi khác theo quy định của luật lao động.</li><li>Công ty có chính sách đầu tư đào tạo và nâng cao kỹ năng nhân sự nắm giữ vị trí quản lý trong tương lai.</li></ul></td>\", \"platform\": \"Office Sevago\", \"priority\": \"Gấp\", \"quantity\": 1, \"createdAt\": \"2025-08-07T10:31:08.863Z\", \"deletedAt\": null, \"maxSalary\": 30000000, \"minSalary\": 20000000, \"orgUnitId\": \"ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f\", \"updatedAt\": \"2025-08-07T11:18:32.000Z\", \"industryId\": null, \"jobTitleId\": \"11351ee0-87cb-4b05-91a8-9fffb879f44e\", \"positionId\": \"f7a328b4-02d0-4520-83b4-4d5a6b61a938\", \"postedDate\": null, \"attachments\": [{\"url\": \"https://dev.office.sevago.local/upload/JD-Front-end-Dev%20(1).docx\", \"name\": \"JD-Front-end-Dev (1).docx\"}], \"createdById\": \"63fc4397-ec0e-43ae-81ad-2e36229f94a5\", \"description\": \"<td><ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js. </li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next.js. </li><li>Có khả năng xây dựng giao diện người dùng (UI) động, mạnh mẽ và đáp ứng (Responsive) cho ứng dụng. </li><li>Tham gia vào tất cả các khâu của sản phẩm bao gồm thiết kế, kiểm thử (Tester), phân tích nghiệp vụ (BA), nghiên cứu công nghệ mới để cải tiến chất lượng sản phẩm. </li><li>Thực hiện các báo cáo theo yêu cầu. </li><li>Thực hiện những nhiệm vụ khác được giao bởi cấp quản lý trực tiếp và Ban Giám đốc</li></ul></td>\", \"expiredDate\": null, \"requirement\": \"<td><ul><li>Tốt nghiệp cao đẳng/đại học chuyên ngành Công nghệ thông tin, Khoa học máy tính, hoặc các ngành liên quan.</li><li>Có thể sử dụng TypeScript. </li><li>Sử dụng thành thạo Figma và triển khai Frontend. </li><li>Có kinh nghiệm xây dựng website sử dụng HTML, CSS, JavaScript. </li><li>Có kinh nghiệm với các framework như Bootstrap, Material UI, Ant Design, Tailwind CSS. </li><li>Sử dụng thành thạo React.js và Next.js. </li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub. </li><li>Biết sử dụng Firebase và Socket.io. </li><li>Kinh nghiệm làm việc với Redux Toolkit.</li><li>Thành thạo các công cụ quản lý mã nguồn: GIT.</li><li>Có hiểu biết về thiết kế hệ thống, tối ưu và nâng cao hiệu năng, độ ổn định.</li><li>Tư duy mở, sẵn sàng học và tìm hiểu các công nghệ mới. Có trách nhiệm với công việc.</li><li>Phong cách làm việc chỉn chu, cẩn thận, tỉ mỉ, chuyên nghiệp. Có sức khỏe và chịu áp lực công việc tốt.</li><li>Giới tính: Nam/Nữ; Tuổi: dưới 35 tuổi.</li><li>Có kinh nghiệm làm việc với Axios, JWT, Git, GitHub. </li><li><strong>Văn phòng làm việc:</strong> 200 Nguyễn Văn Bá, Phường Trường Thọ, Tp. Thủ Đức, TP. HCM</li></ul></td>\", \"updatedById\": null, \"appliedCount\": 0, \"onboardCount\": 0, \"completionDate\": null, \"hrRejectReason\": null, \"hrRejectedById\": null, \"requestGroupId\": \"8616f141-9a90-4537-8994-9fb5db514048\", \"acceptanceCount\": 0, \"experienceNumber\": 5, \"interviewedCount\": 0, \"maxExpectedSalary\": 30000000, \"minExpectedSalary\": 20000000, \"recruitmentReason\": \"Tuyển mới\", \"expectedOnboardDate\": \"2025-08-07T01:36:38.000Z\", \"passedInterviewCount\": 0}','{\"tag\": \"Tuyển gấp\", \"name\": \"Trưởng phòng phát triển phần mềm\", \"note\": \"\", \"address\": \"Văn phòng, 200 Nguyễn Văn Bá, P.Trường Thọ, TP. Thủ Đức, TP. Hồ Chí Minh\", \"ownerId\": \"45839203-ac57-4fe7-8d14-7a8a80d1acdc\", \"welfare\": \"<ul><li>Môi trường làm việc hiện đại, chuyên nghiệp, năng động, thân thiện, nhiều điều kiện, học hỏi và thăng tiến</li><li>Thời gian làm việc: 7h45 đến 16h45, từ thứ 2 - thứ 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa.</li><li>Thưởng chuyên cần 800.000 đồng/tháng.</li><li>Được hưởng các chế độ dành cho người lao động theo quy định pháp luật hiện hành (nghỉ phép, lễ, tết,…).</li><li>Được hưởng các chính sách phúc lợi theo quy định của Công ty: sinh nhật cá nhân, cưới hỏi, thăm hỏi ốm đau, du lịch nghỉ mát, khám sức khỏe định kỳ hằng năm.</li><li>Tham gia đầy đủ BHYT, BHXH, BHTN theo quy định và các quyền lợi khác theo quy định của luật lao động.</li><li>Công ty có chính sách đầu tư đào tạo và nâng cao kỹ năng nhân sự nắm giữ vị trí quản lý trong tương lai.</li></ul>\", \"maxSalary\": 30000000, \"minSalary\": 20000000, \"industryId\": \"0a3ccdd7-cf08-4529-86a6-cbc76dfb0c9e\", \"description\": \"<ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js.</li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next