 7.</li><li>Lương Thỏa thuận theo năng lực.</li><li>Lương tháng 13, lương thâm niên quy định Công ty.</li><li>Được hỗ trợ cơm trưa. </li><li>Thưởng chuyên cần 800.000 đồng/tháng.</li><li>Được hưởng các chế độ dành cho người lao động theo quy định pháp luật hiện hành (nghỉ phép, lễ, tết,…).</li><li>Được hưởng các chính sách phúc lợi theo quy định của Công ty: sinh nhật cá nhân, cưới hỏi, thăm hỏi ốm đau, du lịch nghỉ mát, khám sức khỏe định kỳ hằng năm.</li><li>Tham gia đầy đủ BHYT, BHXH, BHTN theo quy định và các quyền lợi khác theo quy định của luật lao động.</li><li>Công ty có chính sách đầu tư đào tạo và nâng cao kỹ năng nhân sự nắm giữ vị trí quản lý trong tương lai.</li></ul></td>\", \"platform\": \"Office Sevago\", \"priority\": \"Bình thường\", \"quantity\": 1, \"createdAt\": \"2025-08-07T10:08:59.849Z\", \"deletedAt\": null, \"maxSalary\": 20000000, \"minSalary\": 10000000, \"orgUnitId\": \"ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f\", \"updatedAt\": \"2025-08-07T10:08:59.849Z\", \"jobTitleId\": \"77f6b26f-1e11-4228-838b-42b56c15950f\", \"positionId\": \"f9374544-9491-44a9-bb71-502757dc03f0\", \"attachments\": [{\"url\": \"https://dev.office.sevago.local/upload/JD-Front-end-Dev.docx\", \"name\": \"JD-Front-end-Dev.docx\"}], \"createdById\": \"664cbb3f-5bcb-460f-8532-aac98c9bd340\", \"description\": \"<td><ul><li>Thiết kế và triển khai các ứng dụng web chủ yếu sử dụng React.js. </li><li>Tham gia vào phát triển và vận hành các web apps, hệ thống sử dụng Next.js. </li><li>Có khả năng xây dựng giao diện người dùng (UI) động, mạnh mẽ và đáp ứng (Responsive) cho ứng dụng. </li><li>Tham gia vào tất cả các khâu của sản phẩm bao gồm thiết kế, kiểm thử (Tester), phân tích nghiệp vụ (BA), nghiên cứu công nghệ mới để cải tiến chất lượng sản phẩm. </li><li>Thực hiện các báo cáo theo yêu cầu. </li><li>Thực hiện những nhiệm vụ khác được giao bởi cấp quản lý trực tiếp và Ban Giám đốc</li></ul></td>\", \"requirement\": \"<td><ul><li>Tốt nghiệp cao đẳng/đại học chuyên ngành Công ng