','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-08-08 01:52:15.073867','2025-08-08 01:52:15.073867',NULL,'Bộ phận kinh doanh B2B2C','7','Hoạt động',0,'88c4644b-3997-4d0f-8913-d6133d5cbd05',NULL,''),('4431a0b5-9e1e-4cec-9899-56b1f1b2a08b','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-29 07:02:54.000000',NULL,'Xưởng Tiền Sản xuất','5','Hoạt động',0,'2d9dfe34-0f22-49e1-811a-8a1b884732f6','8c7b0764-6411-48b2-9a2d-5cfab3cc9f6a',''),('45499a10-28f8-40bc-a4cd-d090f8efb26c','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:31:04.487699','2025-08-01 03:28:03.000000',NULL,'Team Quản trị hệ thống','9','Hoạt động',0,'96377a25-a195-4dad-bd28-4bdb764edc67',NULL,'<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p style=\"text-align:justify;\">\'Chịu trách nhiệm quản lý và vận hành toàn bộ hệ thống máy chủ (vật lý, ảo hóa, cloud) và các hệ quản trị cơ sở dữ liệu, đảm bảo chúng luôn sẵn sàng, hiệu suất cao và được sao lưu an toàn để làm nền tảng cho các ứng dụng Core.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p>\'- Thiết kế, triển khai, cấu hình và bảo trì hệ thống máy chủ và môi trường Cloud.<br>- Quản trị hệ điều hành (Windows Server, Linux) và các dịch vụ nền tảng (AD, DNS, DHCP).<br>- Cài đặt, cấu hình, giám sát và tối ưu hóa hiệu suất các hệ quản trị CSDL.<br>- Thiết lập và quản lý các hệ thống sao lưu, phục hồi dữ liệu và kế hoạch khắc phục thảm họa (DRP).<br>&nbsp;</p>'),('47acb14c-9291-454b-8dbb-db740b0fb715',NULL,NULL,'2025-07-04 09:27:34.674089','2025-07-29 09:02:52.733268',NULL,'Ban giám đốc','1','Hoạt động',0,NULL,'0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL),('486696ab-2467-40c0-a8e6-b691c770d65f','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.629000','2025-07-30 02:38:23.000000',NULL,'Khối Marketing','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','327326db-ac5b-452a-867c-7679a605c9d0',NULL),('48f1e489-125c-4d3d-ae61-a4b058d45222','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:30:08.359424','2025-08-07 11:30:08.359424',NULL,'Bộ phận Quản lý và theo dõi đơn hàng','7','Hoạt động',0,'1f0e22b9-c685-483d-814a-4df09e1fbdf9',NULL,''),('4a4b6f80-5cdf-4a7e-ae46-8f666fb04a21','d9f850c3-6184-4f49-894b-aeb198464bd0','ae2c0017-4bbb-4d24-ae65-73dac1883c49','2025-06-17 03:21:35.629000','2025-08-01 06:14:23.000000',NULL,'Khối Công nghệ số','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','664cbb3f-5bcb-460f-8532-aac98c9bd340','<p><strong>I. Chức năng</strong></p><p>Khối Công nghệ số, dưới sự lãnh đạo của CTO, đóng vai trò hạt nhân trong việc định hình, phát triển và vận hành toàn bộ nền tảng công nghệ thông tin và số hóa của công ty, nhằm thúc đẩy sự đổi mới, tối ưu hóa hoạt động sản xuất, quản lý doanh nghiệp và mở rộng kênh kinh doanh trực tuyến. Khối chịu trách nhiệm chính trong việc xây dựng, triển khai và quản lý ba hệ thống Core huyết mạch: Core MES (Manufacturing Execution System) để quản lý và vận hành hệ thống sản xuất và gia công kim hoàn; Core ERP (Enterprise Resource Planning) để quản lý và vận hành toàn diện hệ thống doanh nghiệp; và Nền tảng Website (E-commerce Platform) để chuyển đổi mô hình kinh doanh từ B2B sang B2B2C và cuối cùng là D2C, tạo ra trải nghiệm khách hàng vượt trội.</p><p>&nbsp;</p><p><strong>II. Nhiệm vụ</strong></p><p>A. Định hướng và Lập chiến lược Công nghệ:</p><p>+ Xây dựng và đề xuất chiến lược công nghệ số tổng thể, phù hợp với tầm nhìn, sứ mệnh và mục tiêu kinh doanh dài hạn của công ty sản xuất và gia công kim hoàn.<br>+ Phân tích và xác định lộ trình công nghệ, các công nghệ chủ chốt cần đầu tư, đặc biệt là cho việc phát triển và tích hợp sâu rộng các hệ thống Core MES, ERP và Website.<br>+ Dẫn dắt việc lựa chọn kiến trúc hệ thống (Enterprise Architecture) và các công nghệ nền tảng, đảm bảo tính bền vững, khả năng mở rộng, bảo mật và hiệu quả chi phí.</p><p>&nbsp;</p><p>B. Quản lý và Giám sát Dự án Chiến lược:</p><p>+ Chủ trì việc lập kế hoạch, tổ chức, điều phối và giám sát toàn bộ các dự án công nghệ thông tin trọng điểm của công ty, từ giai đoạn nghiên cứu khả thi, thiết kế, phát triển, thử nghiệm, triển khai đến vận hành và bảo trì.<br>+ Đảm bảo các dự án, đặc biệt là các dự án liên quan đến hệ thống Core, được hoàn thành đúng phạm vi, chất lượng, tiến độ và trong khuôn khổ ngân sách đã được phê duyệt.<br>Xây dựng và triển khai các quy trình quản lý dự án hiệu quả (ví dụ: Agile, Scrum, Waterfall).</p><p>&nbsp;</p><p>C. Quản lý Nguồn lực Công nghệ:</p><p>+ Chịu trách nhiệm tuyển dụng, đào tạo, phát triển năng lực chuyên môn và quản lý hiệu suất của toàn bộ đội ngũ nhân sự công nghệ số (bao gồm lập trình viên, BA, QA/QC, kỹ sư hạ tầng, chuyên gia bảo mật...).<br>+ Xây dựng cơ cấu tổ chức tối ưu cho Khối CNS, phân công nhiệm vụ rõ ràng và thúc đẩy văn hóa hợp tác, đổi mới sáng tạo.<br>+ Quản lý và tối ưu hóa việc sử dụng các nguồn lực công nghệ (con người, công cụ, hạ tầng) để đạt hiệu quả cao nhất.</p><p>&nbsp;</p><p>D. Quản lý Rủi ro và An ninh Thông tin:</p><p>+ Thiết lập và thực thi các chính sách, quy trình bảo mật thông tin toàn diện để bảo vệ tài sản số, dữ liệu nhạy cảm của công ty (đặc biệt là dữ liệu sản xuất, thiết kế kim hoàn, thông tin khách hàng) khỏi các mối đe dọa bên trong và bên ngoài.<br>+ Phát triển và định kỳ kiểm thử kế hoạch khắc phục sự cố (Incident Response Plan) và kế hoạch duy trì hoạt động kinh doanh liên tục (Business Continuity Plan - BCP) cho toàn bộ hệ thống IT.</p><p>&nbsp;</p><p>E. Đổi mới và Nghiên cứu Ứng dụng:</p><p>+ Liên tục theo dõi, đánh giá và đề xuất ứng dụng các công nghệ mới và tiên tiến (ví dụ: Trí tuệ Nhân tạo (AI) cho thiết kế/kiểm định kim hoàn, Internet of Things (IoT) cho giám sát sản xuất, Big Data Analytics cho phân tích hành vi khách hàng, Blockchain cho truy xuất nguồn gốc nguyên vật liệu quý) nhằm tối ưu hóa quy trình sản xuất, nâng cao trải nghiệm khách hàng và tạo lợi thế cạnh tranh.<br>+ Thúc đẩy văn hóa đổi mới và thử nghiệm trong khối.</p><p>&nbsp;</p><p>F.Phối hợp Liên phòng ban:</p><p>+ Đóng vai trò là cầu nối chiến lược giữa khối Công nghệ số và các phòng ban chức năng khác (Sản xuất, Kinh doanh, Marketing, Kế toán, Logistics, HR...) để đảm bảo các giải pháp công nghệ đáp ứng đúng và đủ nhu cầu nghiệp vụ, đồng thời tích hợp chặt chẽ vào quy trình kinh doanh tổng thể.<br>+ Đảm bảo sự truyền thông hiệu quả và đồng thuận giữa các bên liên quan.</p>'),('4f4cf7d2-6722-4bf8-a7db-e665173342a3','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.635000','2025-07-30 06:50:13.000000',NULL,'Phòng R&D Công nghệ','5','Hoạt động',0,'55be245f-d4a7-4c63-bd09-09444c5c644a','69575bdd-a7f4-4ee3-b75f-b3f2868e1263',NULL),('538d277b-da41-43b5-b9f8-b776871afbff','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:13:57.470280','2025-08-07 11:13:57.470280',NULL,'Team Pháp lý','9','Hoạt động',0,'bf1f843a-6afe-4908-b986-3a4aae3d2880',NULL,''),('5575707e-0479-43cd-bd52-13bc39b1ca86','7acd37f1-f6cb-4980-a3c6-0a363376691f',NULL,'2025-06-19 01:35:53.307000','2025-06-19 01:36:27.000000','2025-06-19 01:36:27.000000','Phòng Hành chính','5','Hoạt động',0,'b821989f-516e-430b-8b11-e85ad90a2885',NULL,NULL),('55be245f-d4a7-4c63-bd09-09444c5c644a','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.629000','2025-08-04 04:52:49.000000',NULL,'Trung tâm Nghiên cứu phát triển sản phẩm','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','23a2a740-1c9b-4aab-915f-8626f4441f59',''),('55cf5ef7-cebc-4d4f-b733-98426d3cf762','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:39:10.764600','2025-08-07 11:39:10.764600',NULL,'Bộ phận Findings','7','Hoạt động',0,'1816ec1c-784e-438e-ae7e-b630f5ab8f90',NULL,''),('5e68383f-af6a-486b-a0f1-51a6c2e4c368','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:01:56.554090','202