4 06:05:42.000000',NULL,'Phòng R&D Kỹ thuật chế tác','5','Hoạt động',0,'55be245f-d4a7-4c63-bd09-09444c5c644a',NULL,NULL),('709782e9-0fdd-4e3b-83ad-913038cbaa1d','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-08-04 07:17:42.000000',NULL,'Phòng Nhân sự','5','Hoạt động',0,'2c26dff4-fd0a-4132-975f-604ee68d8087',NULL,'<h2 style=\"text-align:justify;\"><strong>Thông tin cơ bản của vị trí nhân viên Nhân sự</strong></h2><blockquote><p><i><strong>Nhân viên nhân sự </strong>là người phụ trách các công việc liên quan đến tuyển dụng, quản lý hoạt động đào tạo và chính sách phúc lợi. Với quy mô doanh nghiệp vừa và nhỏ, thông thường phòng Nhân sự có thể gồm từ 3-5 nhân viên, phụ trách các mảng công việc khác nhau từ tuyển dụng đến hành chính,…&nbsp;</i></p></blockquote><p style=\"text-align:justify;\">Không phải những người đem lại doanh thu hay xử lý các dự án của doanh nghiệp, nhưng nhân viên nhân sự lại có vai trò vô cùng quan trọng. Họ chịu trách nhiệm trong các phần việc sau:&nbsp;</p><ul><li>Tìm kiếm ứng viên phù hợp cho từng vị trí của doanh nghiệp&nbsp;</li><li>Đào tạo nhân sự mới về quy định, văn hóa công ty&nbsp;</li><li>Chăm lo đời sống nội bộ doanh nghiệp, tổ chức các buổi ngoại khóa, tiệc gia tăng tinh thần đoàn kết giữa các nhân viên&nbsp;</li><li>Quản lý chế độ lương thưởng, chính sách đãi ngộ nhân sự</li></ul>'),('7100cf23-3a0f-4138-9787-baedc33ffdde','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:08:15.646738','2025-07-30 06:44:54.000000',NULL,'Team Khoa học dữ liệu','9','Hoạt động',0,'86210f0c-193d-4ea6-bd6c-1ed6a327bbd7','ea1d88b1-b978-4919-9374-1e9df1318bfc',NULL),('729d59c3-d60c-495f-8dbb-f98485173259','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-14 04:41:53.000000',NULL,'Phòng Quản trị rủi ro','5','Hoạt động',0,'c7e31bc3-feb2-49cb-bb1a-d8954b14c8b9',NULL,NULL),('72bc4e4a-8017-4e