6890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 04:39:17.875826','2025-07-17 08:02:32.000000',NULL,'Bộ phận Phân tích dữ liệu','7','Hoạt động',0,'8e7dcc36-5e7a-4bbe-87ab-17d07c858324','201cf53c-d728-405d-850e-62e6f971b45d',NULL),('872f4e98-3894-48ca-aebf-8cfda81c196d','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-08-02 09:49:05.000000',NULL,'Phòng Hạ tầng CNTT','5','Hoạt động',0,'4a4b6f80-5cdf-4a7e-ae46-8f666fb04a21',NULL,'<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p style=\"text-align:justify;\">Chịu trách nhiệm thiết lập, vận hành, bảo trì và bảo mật toàn bộ cơ sở hạ tầng công nghệ thông tin của công ty, bao gồm mạng, máy chủ, cơ sở dữ liệu và thiết bị người dùng cuối. Mục tiêu là đảm bảo tính sẵn sàng cao, ổn định, hiệu suất tối ưu và bảo mật vững chắc cho tất cả các hệ thống và ứng dụng kinh doanh.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p>1. Xây dựng và phát triển hạ tầng CNTT:<br>- Thiết kế, triển khai và bảo trì hệ thống mạng: Đảm bảo kết nối mạng ổn định, tốc độ cao cho toàn công ty.<br>- Quản lý máy chủ, hệ thống lưu trữ dữ liệu: Duy trì hoạt động ổn định của các máy chủ, đảm bảo an toàn và khả năng truy cập dữ liệu.<br>- Quản lý phần cứng, phần mềm: Đảm bảo các thiết bị, phần mềm hoạt động tốt, đáp ứng nhu cầu sử dụng của người dùng.<br>- Xây dựng và quản lý trung tâm dữ liệu: Đảm bảo hạ tầng kỹ thuật cho việc lưu trữ, xử lý và bảo mật dữ liệu.</p><p><br>2. Quản lý và vận hành hệ thống:<br>- Theo dõi, giám sát hoạt động của hệ thống: Phát hiện và xử lý sớm các sự cố về phần cứng, phần mềm, mạng.<br>- Cung cấp các dịch vụ CNTT: Đảm bảo người dùng có thể truy cập và sử dụng các tài nguyên CNTT một cách hiệu quả.<br>- Tối ưu hóa hiệu suất hệ thống: Đảm bảo hệ thống hoạt động ổn định, hiệu quả và đáp ứng nhu cầu của người dùng.</p><p><br>3. Đảm bảo an toàn thông tin:<br>- Xây dựng và triển khai các chính sách bảo mật: Bảo vệ dữ liệu của tổ chức khỏi các mối đe dọa bên ngoài.<br>- Thực hiện các biện pháp bảo mật: Ngăn chặn truy cập trái phép, tấn công mạng, và các hành vi vi phạm an ninh thông tin.<br>- Đào tạo, nâng cao nhận thức về an toàn thông tin: Giúp người dùng hiểu rõ các nguy cơ và cách thức bảo vệ thông tin cá nhân và của công ty.</p><p><br>4. Hỗ trợ người dùng:<br>- Giải đáp thắc mắc, hỗ trợ kỹ thuật: Giúp người dùng sử dụng các tài nguyên CNTT một cách hiệu quả.<br>- Tổ chức các khóa đào tạo: Nâng cao kiến thức và kỹ năng sử dụng CNTT cho người dùng.</p><p><br>5. Nghiên cứu và ứng dụng công nghệ mới:<br>- Tìm hiểu, đánh giá các công nghệ mới: Đề xuất các giải pháp CNTT tiên tiến để nâng cao hiệu quả hoạt động của công ty.<br>- Triển khai các ứng dụng CNTT mới: Đảm bảo tổ chức luôn cập nhật và tận dụng các công nghệ mới nhất.</p>'),('887c5899-e855-4a81-aec3-fe3ef60f729f','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:32:23.325725','2025-07-30 06:34:46.000000',NULL,'Team An ninh và Bảo mật hệ thống','9','Hoạt động',0,'04f45279-b01d-4d4b-9837-d9e13170b875','364c3a66-2e58-4ee9-a545-2c5055cd100a',NULL),('88c4644b-3997-4d0f-8913-d6133d5cbd05','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-25 02:38:58.000000',NULL,'Phòng Kinh doanh B2B & B2B2C','5','Hoạt động',0,'94d77fe3-0290-4613-9a68-4bf073f50752',NULL,NULL),('89b98c4a-114c-42de-aa6f-ce74b9091a32','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:39:22.988226','2025-08-07 11:39:22.988226',NULL,'Bộ phận MC Đúc','7','Hoạt động',0,'1816ec1c-784e-438e-ae7e-b630f5ab8f90',NULL,''),('89cacad8-28af-4194-9182-a520f6d31d55','057353fa-b28c-472e-95b6-13b30c2163bb','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-08-07 10:33:10.056577','2025-08-08 01:44:52.000000',NULL,'Bộ phận Thu hồi phân kim','7','Hoạt động',0,'b79a3ba5-f09d-4e45-a964-d70847351860','b1c05725-95b8-48f3-879d-a022a35e7f72',''),('8b1cde1c-fe5f-4795-adf8-9224dda22147','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-14 04:24:49.964654','2025-07-30 06:46:56.000000',NULL,'Team QA/QC - ERP','9','Hoạt động',0,'7f68f604-aa2d-445a-a474-7be35c833824','71319f0e-2494-48c0-a6ee-44711d588296',NULL),('8e7dcc36-5e7a-4bbe-87ab-17d07c858324','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-31 01:17:45.000000',NULL,'Phòng phân tích Nghiệp vụ & Dữ liệu','5','Hoạt động',0,'4a4b6f80-5cdf-4a7e-ae46-8f666fb04a21',NULL,'<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p style=\"text-align:justify;\">Đóng vai trò là trung tâm chuyên môn hóa, là cầu nối quan trọng giữa các phòng ban chức năng và đội ngũ công nghệ. Phòng chịu trách nhiệm chuyển đổi nhu cầu kinh doanh thành giải pháp công nghệ khả thi, tối ưu hóa quy trình, đảm bảo chất lượng sản phẩm và khai thác giá trị từ dữ liệu.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p style=\"text-align:justify;\">&nbsp;</p><p>1. Phân tích nghiệp vụ (Business Analysis)<br>- Thu thập và phân tích yêu cầu nghiệp vụ từ các phòng ban như: kinh doanh, kế hoạch, sản xuất, kho, nhân sự, tài chính kế toán...<br>- Hiểu rõ quy trình vận hành đặc thù ngành kim hoàn:<br>&nbsp; &nbsp; &nbsp;Quản lý tồn kho theo từng mẫu mã, trọng lượng, chất liệu (vàng 18K, 24K, bạc, đá quý…)<br>&nbsp; &nbsp; &nbsp;Quản lý định giá theo tỷ giá vàng và nguyên vật liệu<br>&nbsp; &nbsp; &nbsp;Quản lý chế tác, gia công, đặt hàng theo yêu cầu<br>&nbsp; &nbsp; &nbsp;Đề xuất cải tiến quy trình để giảm thất thoát, tối ưu hiệu suất và nâng cao trải nghiệm khách hàng</p><p><br>2. Phân tích dữ liệu và báo cáo quản trị<br>- Thu thập và trực quan hóa dữ liệu từ các nguồn: ERP,kinh doanh, sản xuất, kho, CRM...<br>- Phân tích:<br>&nbsp; &nbsp; &nbsp;Hiệu quả kinh doanh theo sản phẩm, khu vực, cửa hàng<br>&nbsp; &nbsp; &nbsp;Xu hướng tiêu dùng theo mùa vụ, dòng sản phẩm, phân khúc khách hàng<br>&nbsp; &nbsp; &nbsp;Hiệu suất bán hàng, tỷ lệ chuyển đổi<br>&nbsp; &nbsp; &nbsp;Quản lý tồn kho: sản phẩm bán chậm, hàng lỗi mốt, hàng bị lãng phí giá trị<br>&nbsp; &nbsp; &nbsp;Xây dựng dashboard báo cáo cho Ban lãnh đạo và các phòng ban sử dụng (Power BI, Excel, Looker Studio…)</p><p><br>3. Hỗ trợ phát triển hệ thống &amp; chuyển đổi số<br>- Tham gia xây dựng hoặc cải tiến các hệ thống:<br>- Quản lý sản phẩm theo mã vạch, lô hàng, định lượng vàng/đá<br>- Hệ thống ERP, MES, CRM, Website<br>- Đóng vai trò cầu nối giữa phòng nghiệp vụ và IT để đảm bảo các hệ thống phản ánh đúng thực tế kinh doanh</p><p><br>4. Đảm bảo dữ liệu chính xác và hỗ trợ quản lý tài sản có giá trị cao<br>- Xác thực và đồng bộ dữ liệu về trọng lượng, chất liệu, giá vàng theo thời điểm<br>- Quản lý dữ liệu nhạy cảm như: giá vốn, giá bán, tỷ suất lợi nhuận, mã đá quý</p><p><br>5. Đào tạo, truyền thông và hỗ trợ ra quyết định dựa trên dữ liệu<br>- Đào tạo nhân viên sử dụng báo cáo hiệu quả<br>- Hỗ trợ các bộ phận tự khai thác dữ liệu báo cáo khi cần<br>- Góp phần xây dựng văn hóa làm việc số và dữ liệu hóa trong doanh nghiệp kim hoàn</p>'),('8ea9c3c3-1102-4730-924c-548cb1557a41','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:28:57.453725','2025-07-09 07:13:01.000000',NULL,'Team Trí tuệ nhân tạo MES','9','Hoạt động',0,'f5662bf6-331d-4238-b12a-b40f6e2f6f7b',NULL,NULL),('94d77fe3-0290-4613-9a68-4bf073f50752','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.629000','2025-07-30 06:49:27.000000',NULL,'Khối Kinh doanh Sỉ','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','46028ac4-b752-4e32-a26d-680f98b6957b',NULL),('96377a25-a195-4dad-bd28-4bdb764edc67','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 04:30:45.168781','2025-08-08 01:46:11.000000',NULL,'Bộ phận Hạ tầng mạng','7','Hoạt động',0,'872f4e98-3894-48ca-aebf-8cfda81c196d','fccebe4d-8840-42eb-be17-7dea516a7136','<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p>- Thiết kế, triển khai, vận hành và bảo trì toàn bộ hệ thống mạng, máy chủ, thiết bị mạng, trung tâm dữ liệu (Data Center) và các thành phần hạ tầng CNTT của công ty.<br>- Đảm bảo tính ổn định, an toàn, sẵn sàng cao và hiệu suất tối ưu cho các hệ thống CNTT phục vụ hoạt động sản xuất – kinh doanh.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p>1. Thiết kế và triển khai hạ tầng mạng<br>- Lập kế hoạch và thiết kế hệ thống mạng nội bộ (LAN), mạng diện rộng (WAN), VPN, Wi-Fi, mạng giữa các chi nhánh.<br>- Lựa chọn thiết bị mạng phù hợp: router, switch, firewall, access point, load balancer…<br>- Thiết lập hệ thống phân vùng mạng (VLAN), định tuyến, chuyển mạch, cân bằng tải.</p><p><br>2. Quản trị hệ thống máy chủ và thiết bị<br>- Cài đặt, cấu hình và duy trì các máy chủ vật lý, máy chủ ảo hóa (VMware/Hyper-V/KVM).<br>- Quản lý hệ điều hành máy chủ (Windows Server, Linux...), AD, DNS, DHCP, file server, print server.<br>- Vận hành các dịch vụ nền tảng như email, FTP, dịch vụ đồng bộ tệp, NAS/SAN lưu trữ...</p><p><br>3. Bảo mật hạ tầng mạng<br>- Thiết lập hệ thống firewall, IDS/IPS, NAT, DMZ, bảo vệ hệ thống mạng trước các cuộc tấn công.<br>- Quản lý chứng chỉ bảo mật, xác thực người dùng, phân quyền truy cập theo cấp độ.<br>- Cập nhật định kỳ bản vá bảo mật và kiểm tra điểm yếu hạ tầng.</p><p><br>4. Giám sát, vận hành và khắc phục sự cố<br>- Giám sát liên tục tình trạng hạ tầng qua các công cụ như Zabbix, PRTG, SolarWinds...<br>- Phản ứng nhanh và xử lý sự cố mạng, gián đoạn dịch vụ hoặc các cuộc tấn công mạng (DDoS, malware).<br>- Đảm bảo SLA của hệ thống đạt mức độ cam kết (uptime ≥ 99.9%).</p><p><br>5. Sao lưu – khôi phục – dự phòng<br>- Thiết lập hệ thống backup dữ liệu định kỳ (toàn phần &amp; gia tăng) cho máy chủ và dịch vụ quan trọng.<br>- Thiết kế hệ thống dự phòng mạng – máy chủ – điện – kết nối để duy trì hoạt động liên tục (BCP/DRP).<br>- Đảm bảo khả năng khôi phục dữ liệu nhanh chóng khi xảy ra sự cố.</p><p><br>6. Hỗ trợ kỹ thuật cho các hệ thống CNTT khác<br>- Cung cấp nền tảng cho các bộ phận: phát triển phần mềm, ERP, MES, email, camera giám sát, điện toán đám mây, v.v.<br>- Thiết lập kết nối giữa hạ tầng nội bộ với các nền tảng Cloud (AWS, Azure, Google Cloud…).<br>- Hỗ trợ bộ phận helpdesk/IT support xử lý các yêu cầu liên quan đến truy cập mạng, máy chủ, Wi-Fi</p>'),('96a9a48d-dca8-45b1-aa6c-03c1ef8e740c','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:29:53.769992','2025-07-30 06:34:14.000000',NULL,'Bộ phận Xử lý sự cố','7','Hoạt động',0,'872f4e98-3894-48ca-aebf-8cfda81c196d','2f0f0578-751b-4f0f-80d8-67973cbfaa12',NULL),('9d4432cb-38bd-4c6c-b872-f39e0f7e0e00','eb4826a3-1077-4fb4-a170-e6947b40601e',NULL,'2025-07-17 06:36:07.550333','2025-08-02 09:47:25.000000',NULL,'Bộ phận Xây dựng hệ thống & chính sách','7','Hoạt động',0,'709782e9-0fdd-4e3b-83ad-913038cbaa1d',NULL,NULL),('9e35bb6e-20f3-4a30-9616-bc15843527ac','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.629000','2025-08-04 09:33:06.000000',NULL,'Khối CNHH & Môi trường','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','1ff92a42-c626-45c4-8f7e-0a448cef8a44',NULL),('a115eabb-3173-4f8d-9b6d-3eddfe87033c','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:07:55.552030','2025-07-17 08:02:53.000000',NULL,'Team Phân tích dữ liệu','9','Hoạt động',0,'86210f0c-193d-4ea6-bd6c-1ed6a327bbd7','ec822979-1474-48a1-a496-6aabfbebc88b',NULL),('a128eb40-57cb-43b5-8dbc-02dff4d026bc','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:30:30.971071','2025-08-07 11:30:30.971071',NULL,'Bộ phận Kế hoạch điều độ','7','Hoạt động',0,'1f0e22b9-c685-483d-814a-4df09e1fbdf9',NULL,''),('a36cb04b-19e1-4651-b449-728838228ce2','0babcca3-9a9a-4d82-8e17-24e2f0936890'