'faf74865-5b10-412b-ad49-76e1a395a770',NULL),('be79e2d7-0a61-4a21-b199-4d36d623a35a','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-14 04:23:42.627168','2025-07-30 07:07:41.000000',NULL,'Team UI/UX - WEB','9','Hoạt động',0,'6b9007f3-4760-48a9-9032-6a7f67043ba5','9d94e4f7-e21a-4783-a783-677b0cc5b7bc',NULL),('be86e764-7366-4582-8f34-623959fc557c','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:17:29.716840','2025-08-07 11:17:29.716840',NULL,'Bộ phận Thiết kế 2D','7','Hoạt động',0,'b537cb2c-7e6b-47e1-bd2d-95c66dcdae04',NULL,''),('bf1f843a-6afe-4908-b986-3a4aae3d2880','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:12:11.677633','2025-08-07 11:12:11.677633',NULL,'Bộ phận Hành chính','7','Hoạt động',0,'bdded6e7-9a7c-44f1-85f6-c3b0a51d071d',NULL,''),('c2a7727e-ae6f-4cac-8f02-7a00c4f268e4','057353fa-b28c-472e-95b6-13b30c2163bb','057353fa-b28c-472e-95b6-13b30c2163bb','2025-08-07 11:21:32.629888','2025-08-07 11:22:00.000000',NULL,'Bộ phận Thiết kế PEARL','7','Hoạt động',0,'b537cb2c-7e6b-47e1-bd2d-95c66dcdae04',NULL,''),('c3f99155-4517-4a91-b52c-55adf2456416','0babcca3-9a9a-4d82-8e17-24e2f0936890','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-07-09 06:30:47.757399','2025-07-30 06:41:25.000000',NULL,'Team Hỗ trợ Kỹ thuật CNTT','9','Hoạt động',0,'96377a25-a195-4dad-bd28-4bdb764edc67','75bcf436-62a7-4ba1-a046-1018a46a6941',NULL),('c48612e3-8206-49e5-89cd-9822b3ae9157','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:08:06.463885','2025-07-30 06:44:35.000000',NULL,'Team Kỹ sư dữ liệu','9','Hoạt động',0,'86210f0c-193d-4ea6-bd6c-1ed6a327bbd7','e54e43f4-cbd1-419c-98bb-ffd0c15cbde5',NULL),('c6ce6bed-6042-4186-b920-51b25d091c9a','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 10:56:56.762621','2025-08-07 10:56:56.762621',NULL,'Bộ phận Render Artist','7','Hoạt động',0,'ff520956-44cb-4106-b096-47c8f32625fb',NULL,''),('c7d5fe28-83cb-4943-935f-8695949c9c2f','d9f850c3-6184-4f49-894b-aeb198464bd0','7acd37f1-f6cb-4980-a3c6-0a363376691f','2025-06-17 03:21:35.635000','2025-07-29 04:28:08.000000',NULL,'Phòng Thương hiệu','5','Hoạt động',0,'486696ab-2467-40c0-a8e6-b691c770d65f','e9d4043b-c5f4-4978-994f-7606cd4e719e',''),('c7e31bc3-feb2-49cb-bb1a-d8954b14c8b9','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.629000','2025-08-07 07:51:47.000000',NULL,'Khối Tài chính - Đầu tư','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','c01e6a20-a2d4-4aa6-ba0f-b0e3a4c21cd9',NULL),('c808291a-a21f-4a6d-a6c4-a148964d7cc8','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:31:51.346424','2025-07-30 06:32:09.000000',NULL,'Team Kỹ thuật đám mây','9','Hoạt động',0,'fdd9435b-2289-41e3-8b5c-fef8bbedef80','06a7b04e-dec8-48b7-9d64-d867f5129fa6','<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p style=\"text-align:justify;\">\'Chịu trách nhiệm quản lý và vận hành toàn bộ hệ thống máy chủ (vật lý, ảo hóa, cloud) và các hệ quản trị cơ sở dữ liệu, đảm bảo chúng luôn sẵn sàng, hiệu suất cao và được sao lưu an toàn để làm nền tảng cho các ứng dụng Core.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p>\'<strong>Vận hành và giám sát tài nguyên Cloud</strong><br>- Quản lý vòng đời tài nguyên (khởi tạo – sử dụng – xóa – cập nhật).<br>- Giám sát hiệu suất, mức sử dụng, chi phí và các sự cố hệ thống thông qua CloudWatch, Azure Monitor, Stackdriver, v.v.<br>- Đảm bảo tính sẵn sàng cao (HA), khả năng mở rộng và hiệu năng của hệ thống.</p><p><br><strong>Quản lý bảo mật và tuân thủ</strong><br>- Thiết lập chính sách IAM (Identity and Access Management): phân quyền truy cập theo vai trò (RBAC).<br>- Áp dụng các biện pháp bảo mật: mã hóa dữ liệu, kiểm tra cấu hình (CIS benchmark), tường lửa ứng dụng (WAF), Zero Trust.<br>- Đảm bảo tuân thủ tiêu chuẩn bảo mật: ISO 27001, GDPR, SOC 2, HIPAA…</p>'),('c9bac70e-0e77-4744-b0bd-8019073dd100','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-14 04:43:40.000000',NULL,'Phòng Chiến lược','5','Hoạt động',0,'6c87d4f9-dece-4305-a75e-173032a670a6',NULL,NULL),('cc5f93a7-e1c9-4847-b1df-e10d9fe50f46','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:32:10.836551','2025-07-30 06:33:51.000000',NULL,'Team Tuân thủ và Pháp lý','9','Hoạt động',0,'04f45279-b01d-4d4b-9837-d9e13170b875','dbd8e3eb-0d3d-4fde-936d-381072d0dcd8',NULL),('ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-30 07:34:06.000000',NULL,'Phòng Phát triển ứng dụng','5','Hoạt động',0,'4a4b6f80-5cdf-4a7e-ae46-8f666fb04a21',NULL,'<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p style=\"text-align:justify;\">Phòng Phát triển phần mềm chịu trách nhiệm toàn bộ vòng đời phát triển các ứng dụng phần mềm cốt lõi của công ty, bao gồm thiết kế kiến trúc, phát triển mã nguồn, kiểm thử, triển khai, tích hợp và bảo trì. Mục tiêu chính là xây dựng và liên tục cải tiến Core MES, Core ERP và Nền tảng Website B2B2C/D2C, đảm bảo các hệ thống này hoạt động ổn định, hiệu quả, bảo mật và đáp ứng đầy đủ, chính xác các yêu cầu nghiệp vụ phức tạp của ngành sản xuất và gia công kim hoàn, cũng như mục tiêu chuyển đổi số và kinh doanh</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p style=\"text-align:justify;\">&nbsp;</p><p>A. Phát triển Hệ thống Core &amp; Ứng dụng:</p><p>+ Dẫn dắt và thực hiện việc thiết kế, phát triển các module, chức năng mới và tùy chỉnh các hệ thống Core MES (quản lý lệnh sản xuất, quy trình gia công, quản lý vật tư, máy móc, chất lượng trong sản xuất kim hoàn), ERP (quản lý tài chính, kế toán, nhân sự, mua hàng, bán hàng, tồn kho) và Nền tảng Website (e-commerce B2B2C/D2C, quản lý sản phẩm kim hoàn, đơn hàng, khách hàng, tích hợp thanh toán và vận chuyển).<br>+ Quản lý backlog, phân chia đầu việc và giám sát tiến độ phát triển của các đội nhóm lập trình.</p><p>&nbsp;</p><p>B. Đảm bảo Chất lượng Mã nguồn &amp; Kiến trúc Phần mềm:</p><p>+ Xây dựng và tuân thủ các quy chuẩn về kiến trúc phần mềm, quy tắc mã hóa (coding convention), quy trình phát triển an toàn (secure SDLC/DevSecOps) và tài liệu hóa chi tiết cho tất cả các dự án phần mềm.<br>+ Đảm bảo tính module hóa, khả năng tái sử dụng, dễ bảo trì và khả năng mở rộng của mã nguồn.</p><p>&nbsp;</p><p>C. Tối ưu Hiệu năng và Khả năng Mở rộng:</p><p>+ Phân tích, thiết kế và triển khai các giải pháp phần mềm có hiệu suất cao, ổn định, chịu tải tốt và có khả năng mở rộng linh hoạt để đáp ứng nhu cầu tăng trưởng về dữ liệu và người dùng.<br>+ Thực hiện các hoạt động tối ưu hóa cơ sở dữ liệu và mã nguồn.</p><p>&nbsp;</p><p>D.Tích hợp Hệ thống:</p><p>+ Phát triển và quản lý các kết nối API (Application Programming Interface) và các cơ chế tích hợp giữa các hệ thống Core (MES-ERP, ERP-Website) và với các hệ thống bên ngoài (ví dụ: logistic, cổng thanh toán, CRM...) để đảm bảo luồng dữ liệu thông suốt và tự động hóa các quy trình liên phòng ban.</p><p>&nbsp;</p><p>E. &nbsp;Bảo trì, Nâng cấp và Hỗ trợ Kỹ thuật:</p><p>+ Cung cấp dịch vụ bảo trì định kỳ, nâng cấp phiên bản phần mềm, vá lỗi và khắc phục sự cố hệ thống.<br>+ Cung cấp hỗ trợ kỹ thuật cấp 2 và 3 cho các vấn đề liên quan đến phần mềm đã triển khai.</p><p>&nbsp;</p><p>F. Nghiên cứu và Ứng dụng Công nghệ:</p><p>+ Nghiên cứu, đánh giá và áp dụng các công nghệ, ngôn ngữ lập trình, framework và công cụ phát triển phần mềm mới nhằm nâng cao năng suất, chất lượng và hiệu quả của quá trình phát triển.<br>+ Đề xuất và thực hiện các dự án Proof-of-Concept (POC) cho các công nghệ mới.</p>'),('d0966faa-9a65-43f3-a460-dd2cc1aa5c39','057353fa-b28c-472e-95b6-13b30c2163bb','057353fa-b28c-472e-95b6-13b30c2163bb','2025-08-07 10:40:38.499742','2025-08-07 10:41:28.000000',NULL,'Bộ phận kỹ sư Hóa','