3b30c2163bb',NULL,'2025-08-07 11:12:55.052998','2025-08-07 11:12:55.052998',NULL,'Bộ phận Dự án - XDCB','7','Hoạt động',0,'bdded6e7-9a7c-44f1-85f6-c3b0a51d071d',NULL,''),('eaf7506c-ecff-4c8a-bdd5-8f197b8250a6','057353fa-b28c-472e-95b6-13b30c2163bb',NULL,'2025-08-07 11:17:50.226815','2025-08-07 11:17:50.226815',NULL,'Bộ phận Thiết kế 3D','7','Hoạt động',0,'b537cb2c-7e6b-47e1-bd2d-95c66dcdae04',NULL,''),('f005ccbd-e07a-4f20-9dce-c20e2ce49457','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-14 04:29:06.947587','2025-07-30 07:09:25.000000',NULL,'Team Trí tuệ nhân tạo ERP','9','Hoạt động',0,'334874d5-9c6a-4a96-9eb6-a50d099792a8','8c25ec0a-89c3-4bcc-99a6-ddd3cd510537',NULL),('f5662bf6-331d-4238-b12a-b40f6e2f6f7b','0babcca3-9a9a-4d82-8e17-24e2f0936890','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-07-08 01:42:08.465426','2025-07-30 07:10:48.000000',NULL,'Bộ phận MES','7','Hoạt động',0,'ce6fe20d-f58f-4814-a3a8-1eefb18e5c1f',NULL,NULL),('f8dd46ad-7f4d-4eb6-be28-6eff1118c2fd','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.635000','2025-07-30 07:06:25.000000',NULL,'Phòng Sản xuất','5','Hoạt động',0,'2d9dfe34-0f22-49e1-811a-8a1b884732f6','e6988acb-9f14-48c5-831c-c92076a6417b',NULL),('fb962aeb-71bf-40ae-9df1-0599c4737ef7','d9f850c3-6184-4f49-894b-aeb198464bd0','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-06-17 03:21:35.635000','2025-07-14 04:41:00.000000',NULL,'Phòng Kiểm soát nội bộ','5','Hoạt động',0,'ff3e69b9-f39e-4ebf-ae46-066d2531e07e',NULL,NULL),('fdd9435b-2289-41e3-8b5c-fef8bbedef80','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-09 06:29:34.695767','2025-07-30 06:31:26.000000',NULL,'Bộ phận Điện toàn đám mây','7','Hoạt động',0,'872f4e98-3894-48ca-aebf-8cfda81c196d','2269e95a-8805-430d-a031-e1bc70b10253','<p style=\"text-align:justify;\"><strong>I. Chức năng</strong></p><p>\'- Quản lý, triển khai và vận hành các tài nguyên, dịch vụ và hạ tầng công nghệ trên môi trường Cloud.<br>- Đảm bảo tính linh hoạt, sẵn sàng, bảo mật và tối ưu chi phí trong việc sử dụng Cloud phục vụ các hoạt động CNTT, phần mềm và kinh doanh.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>II. Nhiệm vụ</strong></p><p>1. Thiết kế và triển khai kiến trúc hạ tầng Cloud<br>- Lên kiến trúc hệ thống trên Cloud (Public/Private/Hybrid).<br>- Thiết lập cấu trúc multi-account, multi-region, redundancy, auto-scaling, load balancing.<br>2. Vận hành và giám sát tài nguyên Cloud<br>- Quản lý vòng đời tài nguyên (khởi tạo – sử dụng – xóa – cập nhật).<br>- Giám sát hiệu suất, mức sử dụng, chi phí và các sự cố hệ thống thông qua CloudWatch, Azure Monitor, Stackdriver, v.v.<br>- Đảm bảo tính sẵn sàng cao (HA), khả năng mở rộng và hiệu năng của hệ thống.<br>3. Quản lý bảo mật và tuân thủ<br>- Thiết lập chính sách IAM (Identity and Access Management): phân quyền truy cập theo vai trò (RBAC).<br>- Áp dụng các biện pháp bảo mật: mã hóa dữ liệu, kiểm tra cấu hình (CIS benchmark), tường lửa ứng dụng (WAF), Zero Trust.<br>- Đảm bảo tuân thủ tiêu chuẩn bảo mật: ISO 27001, GDPR, SOC 2, HIPAA…<br>4. Tích hợp DevOps &amp; CICD<br>- Cung cấp hạ tầng dưới dạng mã (Infrastructure as Code – IaC) sử dụng Terraform, CloudFormation, Pulumi…<br>- Triển khai quy trình CI/CD pipelines sử dụng Jenkins, GitLab CI, GitHub Actions…<br>- Tạo môi trường staging/test/prod tự động, rollback nhanh khi có sự cố.<br>5. Tối ưu chi phí và giám sát ngân sách Cloud<br>- Theo dõi tiêu thụ tài nguyên theo thời gian thực.<br>- Xây dựng các báo cáo chi phí theo team, dự án, hoặc dịch vụ.<br>- Đề xuất chính sách tiết kiệm như Reserved Instance, Auto-shutdown, Spot Instance…<br>6. Hỗ trợ phát triển, kiểm thử, và triển khai phần mềm trên Cloud<br>- Hỗ trợ các nhóm phát triển triển khai microservices, serverless apps, container (ECS, EKS, AKS, GKE).<br>- Cung cấp môi trường linh hoạt và tài nguyên Cloud tự phục vụ (self-service model).<br>- Đảm bảo môi trường Cloud tương thích và ổn định cho các ứng dụng kinh doanh.<br>7. Sao lưu, phục hồi và kế hoạch khẩn cấp<br>- Thiết lập Backup &amp; Disaster Recovery (DR) theo chiến lược RTO/RPO.<br>- Tự động hóa sao lưu theo lịch trình.<br>- Kiểm thử định kỳ khả năng khôi phục dữ liệu và hệ thống.</p>'),('ff3e69b9-f39e-4ebf-ae46-066d2531e07e','d9f850c3-6184-4f49-894b-aeb198464bd0','eb4826a3-1077-4fb4-a170-e6947b40601e','2025-06-17 03:21:35.629000','2025-07-23 03:18:42.000000',NULL,'Khối Vận hành','3','Hoạt động',0,'47acb14c-9291-454b-8dbb-db740b0fb715','8d54cc09-3f34-4681-963e-9e597eaeb8e4',NULL),('ff520956-44cb-4106-b096-47c8f32625fb','057353fa-b28c-472e-95b6-13b30c2163bb','057353fa-b28c-472e-95b6-13b30c2163bb','2025-08-07 10:50:49.622446','2025-08-07 10:51:03.000000',NULL,'Phòng Media','5','Hoạt động',0,'486696ab-2467-40c0-a8e6-b691c770d65f',NULL,'');
