 TIN CHUNG</td></tr><tr><td style=\"height:22.5pt;\" colspan=\"2\">Chức danh công việc&nbsp;</td><td style=\"border-right:.5pt solid black;\" colspan=\"2\">Cấp quản lý trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"2\">Giám đốc Khối Công nghệ số</td><td style=\"border-right:.5pt solid black;\" colspan=\"2\">Tổng Giám Đốc</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"2\">Bộ phận/Phòng ban</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"2\">Cấp dưới trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"2\">Công nghệ số</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"2\">Trưởng phòng</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"2\">Mã công việc&nbsp;</td><td style=\"border-left-style:none;width:314pt;\" colspan=\"2\">Cấp bậc</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"2\">&nbsp;</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"2\">Quản lý cấp cao</td></tr><tr><td style=\"height:15.0pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"height:21.0pt;\" colspan=\"4\">II. MỤC ĐÍCH CÔNG VIỆC</td></tr><tr><td style=\"height:108.0pt;width:552pt;\" colspan=\"4\">- Định hình, phát triển và vận hành toàn bộ nền tảng công nghệ thông tin và số hóa của công ty, nhằm thúc đẩy sự đổi mới, tối ưu hóa hoạt động sản xuất, quản lý doanh nghiệp và mở rộng kênh kinh doanh trực tuyến.&nbsp;<br>- Xây dựng, triển khai và quản lý ba hệ thống Core huyết mạch: Core MES(Manufacturing Execution System) để quản lý và vận hành hệ thống sản xuất và gia công kim hoàn; Core ERP (Enterprise Resource Planning) để quản lý và vận hành toàn diện hệ thống doanh nghiệp; và Nền tảng Website (E-commerce Platform) để chuyển đổi mô hình kinh doanh từ B2B sang B2B2C và cuối cùng là D2C, tạo ra trải nghiệm khách hàng vượt trội.</td></tr><tr><td style=\"height:18.0pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"height:20.25pt;\" colspan=\"4\">III. NHIỆM VỤ CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;\" colspan=\"3\">Nội dung Nhiệm vụ&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">A</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">Nhiệm vụ chính</td></tr><tr><td style=\"border-top-style:none;height:106.9pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">• Định hướng và Lập chiến lược Công nghệ:<br>&nbsp;- Xây dựng và đề xuất chiến lược công nghệ số tổng thể, phù hợp với tầm nhìn, sứ mệnh và mục tiêu kinh doanh dài hạn của công ty.<br>&nbsp;- Phân tích và xác định lộ trình, các công nghệ chủ chốt cần đầu tư, đặc biệt cho việc phát triển và tích hợp sâu rộng các hệ thống Core.<br>&nbsp;- Dẫn dắt việc lựa chọn kiến trúc hệ thống (Enterprise Architecture) và các công nghệ nền tảng, đảm bảo tính bền vững, khả năng mở rộng, bảo mật và hiệu quả chi phí.</td></tr><tr><td style=\"border-top-style:none;height:90.6pt;\">2</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"3\">• Quản lý và Giám sát Dự án Chiến lược:<br>&nbsp;- Chủ trì việc lập kế hoạch, tổ chức, điều phối và giám sát toàn bộ các dự án công nghệ thông tin trọng điểm của công ty.<br>&nbsp;- Đảm bảo các dự án được hoàn thành đúng phạm vi, chất lượng, tiến độ và trong khuôn khổ ngân sách đã được phê duyệt.<br>&nbsp; Xây dựng và triển khai các quy trình quản lý dự án hiệu quả (ví dụ: Agile, Scrum, Waterfall).</td></tr><tr><td style=\"border-top-style:none;height:76.15pt;\">3</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"3\">• Quản lý Nguồn lực Công nghệ:<br>&nbsp;- Chịu trách nhiệm tuyển dụng, đào tạo, phát triển năng lực và quản lý hiệu suất của toàn bộ đội ngũ nhân sự công nghệ số.<br>&nbsp;- Xây dựng cơ cấu tổ chức tối ưu, phân công nhiệm vụ rõ ràng và thúc đẩy văn hóa hợp tác, đổi mới sáng tạo.</td></tr><tr><td style=\"border-top-style:none;height:78.6pt;\">4</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"3\">• Quản lý Rủi ro và An ninh Thông tin:<br>&nbsp;- Thiết lập và thực thi các chính sách, quy trình bảo mật thông tin toàn diện để bảo vệ tài sản số, dữ liệu nhạy cảm của công ty.<br>&nbsp;- Phát triển và định kỳ kiểm thử kế hoạch khắc phục sự cố (Incident Response Plan) và kế hoạch duy trì hoạt động kinh doanh liên tục (Business Continuity Plan - BCP).</td></tr><tr><td style=\"border-top-style:none;height:59.45pt;\">5</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">• Đổi mới và Nghiên cứu Ứng dụng:<br>&nbsp;- Liên tục theo dõi, đánh giá và đề xuất ứng dụng các công nghệ mới và tiên tiến (AI, IoT, Big Data, Blockchain) nhằm tối ưu hóa quy trình, nâng cao trải nghiệm khách hàng và tạo lợi thế cạnh tranh.</td></tr><tr><td style=\"border-top-style:none;height:58.9pt;\">7</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"3\">• Phối hợp Liên phòng ban:<br>Đóng vai trò là cầu nối chiến lược giữa khối Công nghệ số và các phòng ban chức năng khác (Sản xuất, Kinh doanh, Marketing, Kế toán, HR...) để đảm bảo các giải pháp công nghệ đáp ứng đúng nhu cầu nghiệp vụ.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:25.5pt;\">B</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">Nhiệm vụ phụ (nếu có)</td></tr><tr><td style=\"border-top-style:none;height:30.0pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"4\">IV. MỐI QUAN HỆ CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:23.25pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"2\">Quan hệ nội bộ&nbsp;</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Quan hệ bên ngoài&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:42.75pt;\">1</td><td style=\"border-left-style:none;width:246pt;\" colspan=\"2\">Phối hợp với CEO, CMO, COO để tích hợp công nghệ vào hoạt động kinh doanh</td><td style=\"border-left-style:none;width:273pt;\">Làm việc với các đối tác công nghệ, nhà cung cấp giải pháp phần mềm</td></tr><tr><td style=\"border-top-style:none;height:36.75pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"height:22.5pt;\" colspan=\"4\">IV. ĐIỀU KIỆN LÀM VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">1</td><td style=\"border-left-style:none;\" colspan=\"3\">Được cung cấp các trang thiết bị để làm việc theo từng vị trí công việc.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">Được Công ty bố trí không gian và thời gian thích hợp để đảm bảo điều kiện làm việc trong suốt thời gian làm việc tại Công ty theo đúng quy định.</td></tr><tr><td style=\"height:17.25pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\" colspan=\"4\">V. CÁC YÊU CẦU ĐỐI VỚI CHỨC DANH CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">A. Các yêu cầu về bằng cấp, chứng chỉ</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">Trình độ chuyên môn: Tốt nghiệp Đại học trở lên chuyên ngành Công nghệ thông tin, Kỹ thuật phần mềm, Quản trị hệ thống, hoặc lĩnh vực liên quan.</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">2</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"3\">Trình độ ngoại ngữ:</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">3</td><td style=\"border-left-style:none;\" colspan=\"3\">Trình độ vi tính:</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">B. Các yêu cầu về kinh nghiệm, kiến thức</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">Tối thiểu 5–8 năm kinh nghiệm trong vai trò quản lý công nghệ, CTO hoặc tương đương, ưu tiên trong lĩnh vực bán lẻ, thời trang, sản xuất hoặc thương mại điện tử.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">Có kinh nghiệm triển khai hệ thống ERP, CRM, MES, nền tảng bán hàng đa kênh</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">3</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"3\">Ưu tiên ứng viên có các chứng chỉ liên quan đến quản trị CNTT (CIO, PMP, AWS, Azure, v.v.).</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\" colspan=\"4\">&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">C. Các yêu cầu về kỹ năng, phẩm chất</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td colspan=\"3\">Khả năng lãnh đạo chiến lược và điều phối đội nhóm kỹ thuật.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td colspan=\"3\">Tư duy hệ thống, phân tích và ra quyết định.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">3</td><td colspan=\"3\">Giao tiếp tốt, phối hợp hiệu quả với các bộ phận liên quan.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">4</td><td style=\"border-left-style:none;\" colspan=\"3\">Hiểu biết sâu về bảo mật thông tin, kiến trúc hệ thống và quản trị dữ liệu.</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"3\">D. Các yêu cầu đặc biệt khác (nếu có)</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">1</td><td style=\"border-left-style:none;\" colspan=\"3\">&nbsp;</td></tr></tbody></table></figure>','Quản lý đứng đầu đơn vị',3,'Thành viên đơn vị'),('78a50b6c-f1f3-4d4c-9d7d-ab57a3cc0b31','7acd37f1-f6cb-4980-a3c6-0a363376691f','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-17 06:25:40.519504','2025-07-24 09:07:39.000000',NULL,'VP - Chuyên viên','Hoạt động','4dae4965-9dd0-4d9b-b56b-c51baaf481c6',NULL,'Thành viên Sen Vàng',8,'Thành viên đơn vị'),('808c0b8b-490c-430a-a035-691e9c5c40ab','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 06:10:24.079068','2025-07-24 09:08:01.000000',NULL,'TT - Trưởng bộ phận','Hoạt động','b892b751-81b1-49be-9776-83bd6a46f4c3',NULL,'Quản lý đứng đầu đơn vị',5,'Thành viên đơn vị'),('886a5e3a-6de1-48fd-b546-5a7bf755f32a','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 06:10:55.359629','2025-07-24 09:08:01.000000',NULL,'TT - Trưởng nhóm','Hoạt động','808c0b8b-490c-430a-a035-691e9c5c40ab','<p>1221</p>','Quản lý đứng đầu đơn vị',6,'Thành viên đơn vị'),('8cacd137-b4b7-47a3-b901-11c5f094ff50','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-22 07:00:06.538892','2025-07-24 09:07:53.000000',NULL,'SX - Tổ phó','Hoạt động','f9dfe701-a5dd-469d-b70b-0923b61fe5d8',NULL,'Thành viên Sen Vàng',7,'Thành viên đơn vị'),('8d31d5a5-7215-4c20-8f5d-214502ba8b96','7acd37f1-f6cb-4980-a3c6-0a363376691f','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-17 06:24:31.321200','2025-08-08 01:53:56.000000',NULL,'VP - Trưởng bộ phận','Hoạt động','0c1e976f-b3b2-4615-8320-83b5b094af44','<figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:49.71%;\"><col style=\"width:50.29%;\"></colgroup><tbody><tr><td style=\"height:21.0pt;width:552pt;\" colspan=\"2\">I. THÔNG TIN CHUNG</td></tr><tr><td style=\"height:22.5pt;\">Chức danh công việc&nbsp;</td><td style=\"border-right:.5pt solid black;\">Cấp quản lý trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Trưởng bộ phận phân tích nghiệp vụ</td><td style=\"border-right:.5pt solid black;\">Trưởng phòng</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Bộ phận/Phòng ban</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Cấp dưới trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Công nghệ số</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Trưởng nhóm</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Mã công việc&nbsp;</td><td style=\"border-left-style:none;width:314pt;\">Cấp bậc</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">&nbsp;</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Quản lý cấp cơ sở</td></tr></tbody></table></figure><figure class=\"table\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:100%;\"></colgroup><tbody><tr><td style=\"height:21.0pt;width:552pt;\">II. MỤC ĐÍCH CÔNG VIỆC</td></tr><tr><td style=\"height:59.65pt;width:552pt;\">Quản lý và điều phối toàn bộ hoạt động phân tích nghiệp vụ cho các hệ thống phần mềm then chốt (Website, MES sản xuất, ERP quản trị), đảm bảo các giải pháp công nghệ được xây dựng đúng với yêu cầu thực tế, nhất quán quy trình, giúp hệ thống vận hành tối ưu và hiệu quả.</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.97%;\"><col style=\"width:92.03%;\"></colgroup><tbody><tr><td style=\"height:20.25pt;width:552pt;\" colspan=\"2\">III. NHIỆM VỤ CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;\">Nội dung Nhiệm vụ&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">A</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Nhiệm vụ chính</td></tr><tr><td style=\"border-top-style:none;height:92.45pt;\">1</td><td style=\"border-left-style:none;width:519pt;\">Quản lý và điều phối hoạt động phân tích nghiệp vụ<br>- Dẫn dắt đội ngũ BA thực hiện khảo sát, phân tích và mô hình hóa quy trình nghiệp vụ tại các phòng ban: sản xuất, bán hàng, kế toán, kho, bảo hành, CRM…<br>- Thiết lập phương pháp và tiêu chuẩn tài liệu hóa (BRD, FRD, user stories, BPMN, UML...) cho toàn bộ hệ thống.</td></tr><tr><td style=\"border-top-style:none;height:82.9pt;\">2</td><td style=\"border-left-style:none;width:519pt;\">Đảm bảo tính phù hợp của hệ thống Website / MES / ERP<br>Xây dựng logic nghiệp vụ phù hợp với mô hình đặc thù của ngành kim hoàn:<br>- Website: quản lý sản phẩm đa biến thể (vàng, đá quý, trọng lượng), bán hàng online/offline, tích hợp AI/AR thử trang sức.<br>- MES: quản lý quy trình chế tác, theo dõi lệnh sản xuất, kiểm soát chất lượng.<br>- ERP: quản lý đơn hàng, tồn kho, kế toán, mua hàng, hậu mãi.</td></tr><tr><td style=\"border-top-style:none;height:67.9pt;\">3</td><td style=\"border-left-style:none;width:519pt;\">Phối hợp với các phòng ban và đội kỹ thuật<br>- Làm cầu nối giữa bộ phận nghiệp vụ và kỹ thuật, đảm bảo yêu cầu được truyền đạt rõ ràng, logic và có thể phát triển được.<br>- Tham gia kiểm thử hệ thống (UAT), nghiệm thu sản phẩm và hỗ trợ triển khai</td></tr><tr><td style=\"border-top-style:none;height:69.0pt;\">4</td><td style=\"border-left-style:none;width:519pt;\">Quản lý nhóm và phát triển năng lực BA<br>- Tuyển dụng, đào tạo, đánh giá và phát triển đội ngũ Business Analyst.<br>- Xây dựng bộ kỹ năng chuẩn, quy trình làm việc, và hệ thống quản lý kiến thức nghiệp vụ (BA knowledge base).</td></tr><tr><td style=\"border-top-style:none;height:51.6pt;\">5</td><td style=\"border-left-style:none;width:519pt;\">Tư vấn chiến lược và cải tiến liên tục<br>- Đề xuất cải tiến quy trình doanh nghiệp, tự động hóa vận hành, số hóa dữ liệu và quy trình.<br>- Tham gia xây dựng roadmap hệ thống cùng CTO, đảm bảo tính mở rộng, linh hoạt và chuẩn hóa nghiệp vụ.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">6</td><td style=\"border-left-style:none;width:519pt;\">Thực hiện những nhiệm vụ khác được giao bởi cấp Quản lý trực tiếp và Ban Giám đốc.</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.97%;\"><col style=\"width:92.03%;\"></colgroup><tbody><tr><td style=\"height:22.5pt;width:552pt;\" colspan=\"2\">IV. ĐIỀU KIỆN LÀM VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">1</td><td style=\"border-left-style:none;\">Được cung cấp các trang thiết bị để làm việc theo từng vị trí công việc.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Được Công ty bố trí không gian và thời gian thích hợp để đảm bảo điều kiện làm việc trong suốt thời gian làm việc tại Công ty theo đúng quy định.</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.97%;\"><col style=\"width:92.03%;\"></colgroup><tbody><tr><td style=\"border-right:.5pt solid black;height:22.5pt;width:552pt;\" colspan=\"2\">V. CÁC YÊU CẦU ĐỐI VỚI CHỨC DANH CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">A. Các yêu cầu về bằng cấp, chứng chỉ</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Trình độ chuyên môn: Tốt nghiệp Cao đăng Đại học trở lên chuyên ngành: Quản trị kinh doanh, Hệ thống thông tin, CNTT, hoặc tương đương.</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">2</td><td style=\"border-left-style:none;width:519pt;\">Trình độ ngoại ngữ:</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">3</td><td style=\"border-left-style:none;\">Trình độ vi trính:</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">B. Các yêu cầu về kinh nghiệm, kiến thức</td></tr><tr><td style=\"border-top-style:none;height:28.15pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Tối thiểu 5–7 năm kinh nghiệm trong lĩnh vực phân tích nghiệp vụ, trong đó ít nhất 2–3 năm ở vai trò trưởng nhóm hoặc trưởng bộ phận.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Có kinh nghiệm làm việc trực tiếp với hệ thống ERP (như Odoo, SAP, Oracle...), MES và nền tảng eCommerce..</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">3</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Hiểu biết sâu về quy trình sản xuất – kinh doanh – bán lẻ, đặc biệt là ngành kim hoàn</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">4</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Thành thạo mô hình hóa nghiệp vụ (BPMN, UML), công cụ hỗ trợ: Jira, Confluence, Draw.io, Figma.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">5</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Có kiến thức cơ bản về hệ thống dữ liệu, API, tích hợp phần mềm.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">6</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Có khả năng phân tích dữ liệu bằng SQL hoặc BI tools (Power BI, Tableau)</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.97%;\"><col style=\"width:92.03%;\"></colgroup><tbody><tr><td style=\"height:22.5pt;width:33pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">C. Các yêu cầu về kỹ năng, phẩm chất</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Kỹ năng quản lý đội nhóm tốt, có khả năng lãnh đạo, tạo động lực và phát triển năng lực của các thành viên trong nhóm</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Khả năng giao tiếp và trình bày ý tưởng rõ ràng, có thể làm việc và phối hợp tốt với các bộ phận khác</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">3</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Khả năng phân tích và giải quyết vấn đề nhanh chóng, xử lý tốt các tình huống bất ngờ trong vận hành.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">4</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Tư duy chiến lược &amp; giải quyết vấn đề: Đề xuất giải pháp kinh doanh dựa trên dữ liệu.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">5</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Khả năng quản lý thời gian và làm việc với các deadline chặt chẽ.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">6</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Làm việc dưới áp lực cao, quản lý nhiều dự án cùng lúc</td></tr></tbody></table></figure>','Quản lý đứng đầu đơn vị',6,'Thành viên đơn vị'),('ac9948cf-9e93-4aa2-bf98-bf98302f284f','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 07:00:18.292808','2025-07-25 01:52:56.000000',NULL,'SX - Công nhân','Hoạt động','8cacd137-b4b7-47a3-b901-11c5f094ff50',NULL,'Quản lý đứng đầu đơn vị',8,'Thành viên đơn vị'),('b18d94d8-0549-43a8-b8db-104149250882','7acd37f1-f6cb-4980-a3c6-0a363376691f','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-17 06:26:08.259499','2025-07-24 09:07:39.000000',NULL,'VP - Thực tập sinh','Hoạt động','f9374544-9491-44a9-bb71-502757dc03f0',NULL,'Thành viên Sen Vàng',10,'Thành viên đơn vị'),('b892b751-81b1-49be-9776-83bd6a46f4c3','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 06:10:17.405327','2025-07-24 09:08:01.000000',NULL,'TT - Chuyên gia','Hoạt động','5177b8ef-d37d-4e77-a23d-b0e93578d622',NULL,'Quản lý đứng đầu đơn vị',4,'Thành viên đơn vị'),('bdb60433-ff38-410b-bdcd-6f5272f7e016','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-22 06:58:07.857461','2025-07-24 09:07:53.000000',NULL,'SX - Trưởng bộ phận','Hoạt động','e66cd476-6773-42b1-ad97-47a5cd11fb65',NULL,'Quản lý đứng đầu đơn vị',5,'Thành viên đơn vị'),('c11680d0-2cf3-47d2-847c-ae998cf17ac5','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 07:01:13.718768','2025-08-01 07:24:06.000000',NULL,'Trợ lý Tổng giám đốc 2','Hoạt động','330a7e9a-1c08-439a-883b-82c984ee81fe',NULL,'Thành viên Sen Vàng',2,'Thành viên đơn vị'),('d403d4d3-ba80-4669-b5ec-22f503de0608','7acd37f1-f6cb-4980-a3c6-0a363376691f','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-17 06:22:30.413149','2025-08-07 06:24:08.000000',NULL,'Phó Tổng giám đốc','Hoạt động','330a7e9a-1c08-439a-883b-82c984ee81fe',NULL,'Ban giám đốc',2,'Thành viên đơn vị'),('e184bddc-067b-4597-b75e-a3ac1d02fe18','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-08 02:18:35.246806','2025-08-01 07:24:14.000000',NULL,'Trợ lý Tổng giám đốc 1','Hoạt động','330a7e9a-1c08-439a-883b-82c984ee81fe',NULL,'Thành viên Sen Vàng',2,'Thành viên đơn vị'),('e66cd476-6773-42b1-ad97-47a5cd11fb65','0babcca3-9a9a-4d82-8e17-24e2f0936890','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-22 06:57:43.346557','2025-07-24 09:07:53.000000',NULL,'SX - Quản Đốc','Hoạt động','5177b8ef-d37d-4e77-a23d-b0e93578d622','<p>oki dep lam</p>','Quản lý đứng đầu đơn vị',4,'Thành viên đơn vị'),('f7a328b4-02d0-4520-83b4-4d5a6b61a938','7acd37f1-f6cb-4980-a3c6-0a363376691f','ae2c0017-4bbb-4d24-ae65-73dac1883c49','2025-07-17 06:24:00.744990','2025-08-02 03:59:38.000000',NULL,'VP - Trưởng phòng','Hoạt động','5177b8ef-d37d-4e77-a23d-b0e93578d622','<figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:49.71%;\"><col style=\"width:50.29%;\"></colgroup><tbody><tr><td style=\"height:21.0pt;width:552pt;\" colspan=\"2\">I. THÔNG TIN CHUNG</td></tr><tr><td style=\"height:22.5pt;\">Chức danh công việc&nbsp;</td><td style=\"border-right:.5pt solid black;\">Cấp quản lý trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Trưởng phòng phát triển phần mềm</td><td style=\"border-right:.5pt solid black;\">Giám đốc Khối</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Bộ phận/Phòng ban</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Cấp dưới trực tiếp</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Công nghệ số</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Trưởng bộ phận</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">Mã công việc&nbsp;</td><td style=\"border-left-style:none;width:314pt;\">Cấp bậc</td></tr><tr><td style=\"border-right:.5pt solid black;height:22.5pt;\">&nbsp;</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Quản lý cấp trung</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:100%;\"></colgroup><tbody><tr><td style=\"height:21.0pt;width:552pt;\">II. MỤC ĐÍCH CÔNG VIỆC</td></tr><tr><td style=\"height:59.65pt;width:552pt;\">- Quản lý, điều phối, và giám sát toàn bộ quy trình phát triển và vận hành hệ thống phần mềm, bao gồm các hệ thống quan trọng như ERP, MES, và Website.<br>- Đảm bảo các hệ thống phần mềm vận hành hiệu quả, đáp ứng nhu cầu nghiệp vụ và đạt các tiêu chuẩn về chất lượng và bảo mật</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:8.57%;\"><col style=\"width:91.43%;\"></colgroup><tbody><tr><td style=\"height:20.25pt;width:552pt;\" colspan=\"2\">III. NHIỆM VỤ CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;\">Nội dung Nhiệm vụ&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">A</td><td style=\"border-left-style:none;border-right:.5pt solid black;\">Nhiệm vụ chính</td></tr><tr><td style=\"border-top-style:none;height:92.45pt;\">1</td><td style=\"border-left-style:none;width:519pt;\">Quản lý Dự án Phát triển Phần mềm:&nbsp;<br>+ Lập kế hoạch, điều phối và giám sát các dự án phát triển hệ thống phần mềm bao gồm ERP, MES và các ứng dụng website của công ty.<br>&nbsp;+ Đảm bảo tiến độ, phạm vi và ngân sách của các dự án phát triển được duy trì theo kế hoạch, đáp ứng mục tiêu kinh doanh.&nbsp;<br>+ Xác định các yêu cầu kỹ thuật, tài nguyên cần thiết và xây dựng lịch trình phát triển chi tiết cho các dự án.</td></tr><tr><td style=\"border-top-style:none;height:102.6pt;\">2</td><td style=\"border-left-style:none;width:519pt;\">Điều phối và Giám sát Đội ngũ Phát triển:&nbsp;<br>+ Quản lý các nhóm phát triển phần mềm, bao gồm các kỹ sư Backend, Frontend, Data Engineers, và các nhà phát triển tích hợp (Integration Developers).&nbsp;<br>+ Phân công nhiệm vụ, đặt mục tiêu và giám sát hiệu suất của từng thành viên và đội ngũ để đảm bảo công việc đạt chất lượng và đúng hạn.&nbsp;<br>+ Tổ chức các buổi đánh giá định kỳ với đội ngũ để theo dõi tiến độ, phát hiện và giải quyết các vướng mắc trong quá trình phát triển phần mềm</td></tr><tr><td style=\"border-top-style:none;height:96.0pt;\">3</td><td style=\"border-left-style:none;width:519pt;\">Quản lý Chất lượng và Tiêu chuẩn Phần mềm:&nbsp;<br>+ Thiết lập các quy trình kiểm thử và đánh giá chất lượng phần mềm, phối hợp với nhóm QA/QC để đảm bảo các sản phẩm phần mềm đạt tiêu chuẩn về bảo mật, hiệu suất và khả năng mở rộng.&nbsp;<br>+ Theo dõi và đảm bảo các hệ thống ERP, MES, Website đáp ứng các yêu cầu về hiệu suất và bảo mật, đảm bảo tính ổn định và tin cậy.&nbsp;<br>+ Đánh giá và cải tiến quy trình phát triển phần mềm, tối ưu hóa các công cụ và phương pháp nhằm tăng cường hiệu quả làm việc và giảm thiểu lỗi.</td></tr><tr><td style=\"border-top-style:none;height:69.0pt;\">4</td><td style=\"border-left-style:none;width:519pt;\">Hỗ trợ kỹ thuật và xử lý sự cố<br>+ Giám sát và phân tích hiệu suất của hệ thống phần mềm, chủ động nhận diện và khắc phục các lỗi, giảm thiểu rủi ro trong quá trình vận hành.<br>+ Hỗ trợ các nhóm kỹ thuật khác trong việc tích hợp và tương tác giữa các hệ thống, xử lý các vấn đề kỹ thuật khi cần thiết.</td></tr><tr><td style=\"border-top-style:none;height:76.9pt;\">5</td><td style=\"border-left-style:none;width:519pt;\">Định hướng và Tư vấn Công nghệ:&nbsp;<br>+ Theo dõi và nghiên cứu các xu hướng công nghệ mới để đưa ra các giải pháp tối ưu cho hệ thống phần mềm hiện tại và tương lai.&nbsp;<br>+ Tham vấn cho CTO về các quyết định liên quan đến công nghệ, lộ trình phát triển và khả năng tích hợp của các hệ thống phần mềm.</td></tr><tr><td style=\"border-top-style:none;height:56.45pt;\">6</td><td style=\"border-left-style:none;width:519pt;\">Báo cáo và Phân tích Hiệu quả Hoạt động:&nbsp;<br>+ Lập báo cáo tiến độ, chất lượng và hiệu quả hoạt động của các hệ thống phần mềm cho CTO và BGĐ&nbsp;<br>+ Phân tích dữ liệu và phản hồi từ người dùng để đưa ra các đề xuất cải tiến, nâng cao hiệu quả và trải nghiệm người dùng.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">7</td><td style=\"border-left-style:none;width:519pt;\">Thực hiện những nhiệm vụ khác được giao bởi cấp Quản lý trực tiếp và Ban Giám đốc.</td></tr></tbody></table></figure><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.97%;\"><col style=\"width:92.03%;\"></colgroup><tbody><tr><td style=\"height:22.5pt;width:552pt;\" colspan=\"2\">IV. ĐIỀU KIỆN LÀM VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">1</td><td style=\"border-left-style:none;\">Được cung cấp các trang thiết bị để làm việc theo từng vị trí công việc.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\">Được Công ty bố trí không gian và thời gian thích hợp để đảm bảo điều kiện làm việc trong suốt thời gian làm việc tại Công ty theo đúng quy định.</td></tr></tbody></table></figure><figure class=\"table\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.69%;\"><col style=\"width:7.72%;\"></colgroup><tbody><tr><td style=\"border-right:.5pt solid black;height:22.5pt;width:552pt;\" colspan=\"13\">V. CÁC YÊU CẦU ĐỐI VỚI CHỨC DANH CÔNG VIỆC</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"12\">A. Các yêu cầu về bằng cấp, chứng chỉ</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Trình độ chuyên môn: Tốt nghiệp đại học trở lên trong các ngành Công nghệ thông tin, Khoa học máy tính, Kỹ thuật phần mềm, hoặc các lĩnh vực liên quan.</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">2</td><td style=\"border-left-style:none;width:519pt;\" colspan=\"12\">Trình độ ngoại ngữ:</td></tr><tr><td style=\"border-top-style:none;height:24.75pt;\">3</td><td style=\"border-left-style:none;\" colspan=\"12\">Trình độ vi trính:</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"12\">B. Các yêu cầu về kinh nghiệm, kiến thức</td></tr><tr><td style=\"border-top-style:none;height:28.15pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Tối thiểu 5 năm kinh nghiệm trong lĩnh vực phát triển phần mềm, trong đó có ít nhất 2 năm ở vị trí quản lý hoặc lãnh đạo dự án.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kinh nghiệm triển khai và quản lý các hệ thống lớn như ERP, MES là một lợi thế lớn</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">3</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kiến thức chuyên sâu về phát triển phần mềm, quản lý dự án phần mềm và các công nghệ phát triển ứng dụng (Java, .NET, Python, Node.js).</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">4</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Am hiểu về các phương pháp phát triển phần mềm Agile/Scrum, và các công cụ quản lý dự án (JIRA, Asana, Trello)</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">5</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kỹ năng xử lý dữ liệu và tích hợp hệ thống, đặc biệt là khả năng tích hợp các hệ thống ERP và MES.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">6</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kinh nghiệm làm việc với các framework và ngôn ngữ lập trình back-end phổ biến như: + Node.js (Express.js, NestJS) + Java (Spring Boot) + Python (Django, Flask) + PHP (Laravel, Symfony) + Ruby on Rails</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">7</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Hiểu biết về kiến trúc microservices và tích hợp hệ thống bên ngoài (MES, CRM)</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">8</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kinh nghiệm làm việc với các hệ quản trị cơ sở dữ liệu (MySQL, PostgreSQL, Oracle) và các hệ thống lưu trữ phân tán.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">9</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Hiểu biết về bảo mật phần mềm và các quy chuẩn an toàn thông tin.</td></tr><tr><td style=\"border-top-style:none;height:26.25pt;\">10</td><td style=\"border-left-style:none;border-top-style:none;\">&nbsp;</td><td style=\"border-top-style:none;width:38pt;\">&nbsp;</td><td style=\"border-top-style:none;width:45pt;\">&nbsp;</td><td style=\"border-top-style:none;width:46pt;\">&nbsp;</td><td style=\"border-top-style:none;width:41pt;\">&nbsp;</td><td style=\"border-top-style:none;width:41pt;\">&nbsp;</td><td style=\"border-top-style:none;width:46pt;\">&nbsp;</td><td style=\"border-top-style:none;width:46pt;\">&nbsp;</td><td style=\"border-top-style:none;width:41pt;\">&nbsp;</td><td style=\"border-top-style:none;width:41pt;\">&nbsp;</td><td style=\"border-top-style:none;width:41pt;\">&nbsp;</td><td style=\"border-top-style:none;width:58pt;\">&nbsp;</td></tr><tr><td style=\"border-top-style:none;height:22.5pt;\">Stt</td><td style=\"border-left-style:none;border-right:.5pt solid black;\" colspan=\"12\">C. Các yêu cầu về kỹ năng, phẩm chất</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">1</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Kỹ năng quản lý đội nhóm tốt, có khả năng lãnh đạo, tạo động lực và phát triển năng lực của các thành viên trong nhóm</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">2</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Khả năng giao tiếp và trình bày ý tưởng rõ ràng, có thể làm việc và phối hợp tốt với các bộ phận khác</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">3</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Khả năng phân tích và giải quyết vấn đề nhanh chóng, xử lý tốt các tình huống bất ngờ trong vận hành.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">4</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Khả năng giao tiếp và làm việc nhóm tốt, có khả năng giải thích vấn đề kỹ thuật cho các thành viên không chuyên.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">5</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Khả năng quản lý thời gian và làm việc với các deadline chặt chẽ.</td></tr><tr><td style=\"border-top-style:none;height:27.0pt;\">6</td><td style=\"border-left-style:none;border-right:.5pt solid black;width:519pt;\" colspan=\"12\">Tư duy giải quyết vấn đề sáng tạo, linh hoạt.&nbsp;</td></tr></tbody></table></figure>','Quản lý đứng đầu đơn vị',4,'Thành viên đơn vị'),('f9374544-9491-44a9-bb71-502757dc03f0','7acd37f1-f6cb-4980-a3c6-0a363376691f','0babcca3-9a9a-4d82-8e17-24e2f0936890','2025-07-17 06:25:47.452236','2025-07-24 09:07:39.000000',NULL,'VP - Nhân viên','Hoạt động','78a50b6c-f1f3-4d4c-9d7d-ab57a3cc0b31',NULL,'Thành viên Sen Vàng',9,'Thành viên đơn vị'),('f9dfe701-a5dd-469d-b70b-0923b61fe5d8','0babcca3-9a9a-4d82-8e17-24e2f0936890',NULL,'2025-07-22 06:59:55.138671','2025-07-24 09:07:53.000000',NULL,'SX - Tổ trưởng','Hoạt động','bdb60433-ff38-410b-bdcd-6f5272f7e016',NULL,'Quản lý đứng đầu đơn vị',6,'Thành viên đơn vị');
