DROP TABLE IF EXISTS `project_task`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `project_task` (
  `id` varchar(36) NOT NULL,
  `createdById` varchar(36) DEFAULT NULL,
  `updatedById` varchar(36) DEFAULT NULL,
  `createdAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `deletedAt` timestamp(6) NULL DEFAULT NULL,
  `code` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `type` enum('Project','Task') DEFAULT NULL,
  `status` enum('Đang hoạt động','Tạm dừng') NOT NULL DEFAULT 'Đang hoạt động',
  `description` text,
  `budget` decimal(10,0) DEFAULT NULL COMMENT 'Nếu null là không có ngân sách',
  `isBudgetConfirmed` tinyint NOT NULL DEFAULT '0',
  `attachments` json DEFAULT NULL,
  `startDate` timestamp NULL DEFAULT NULL,
  `endDate` timestamp NULL DEFAULT NULL,
  `estimateDate` timestamp NULL DEFAULT NULL,
  `progressPercent` int NOT NULL DEFAULT '0',
  `childrenCount` int NOT NULL DEFAULT '0' COMMENT 'Số lượng các con, có thể là project / task',
  `completedChildrenCount` int NOT NULL DEFAULT '0' COMMENT 'Số lượng các con hoàn thành, có thể là project / task',
  `parentId` varchar(36) DEFAULT NULL,
  `delayReasons` json DEFAULT NULL COMMENT 'Nguyên nhân trễ của task',
  `usedBudget` decimal(10,0) DEFAULT '0' COMMENT 'Ngân sách đã sử dụng',
  `weight` float DEFAULT '0' COMMENT 'Tỉ trọng của task/dự án',
  `priority` enum('Bình thường','Cao','Khẩn cấp') NOT NULL DEFAULT 'Bình thường' COMMENT 'Mức độ ưu tiên của task/dự án',
  `remainingWeight` float DEFAULT '0' COMMENT 'Trọng số còn lại của task/dự án',
  `lastReport` text,
  `completedAt` timestamp NULL DEFAULT NULL,
  `budgetStatus` enum('Không có ngân sách','Chưa gửi phê duyệt','Được phê duyệt','Đã bị từ chối','Đang chờ phê duyệt') NOT NULL DEFAULT 'Không có ngân sách' COMMENT 'Trạng thái ngân sách của task/dự án',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_2289dd977d1bac7642fd23ffaa` (`code`),
  KEY `FK_67343dac6061264aef7e7ce4b36` (`createdById`),
  KEY `FK_f2aab0bfcf4b6e8e17126807c5a` (`updatedById`),
  KEY `FK_8f7e237cde0698dbb201270710e` (`parentId`),
  CONSTRAINT `FK_67343dac6061264aef7e7ce4b36` FOREIGN KEY (`createdById`) REFERENCES `user` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_8f7e237cde0698dbb201270710e` FOREIGN KEY (`parentId`) REFERENCES `project_task` (`id`) ON DELETE CASCADE,
  CONSTRAINT `FK_f2aab0bfcf4b6e8e17126807c5a` FOREIGN KEY (`updatedById`) REFERENCES `user` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
