DROP TABLE IF EXISTS `proposal`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `proposal` (
  `id` varchar(36) NOT NULL,
  `createdById` varchar(36) DEFAULT NULL,
  `updatedById` varchar(36) DEFAULT NULL,
  `createdAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `deletedAt` timestamp(6) NULL DEFAULT NULL,
  `code` varchar(255) NOT NULL,
  `title` text NOT NULL,
  `type` enum('Gia hạn thời hạn','Thay đổi người phụ trách','Thay đổi đơn vị','Phê duyệt ngân sách','Hủy','Khác') NOT NULL DEFAULT 'Gia hạn thời hạn',
  `amount` int NOT NULL DEFAULT '0' COMMENT 'Lưu số tiền đề xuất',
  `progress` int NOT NULL DEFAULT '0' COMMENT 'Progress at the time of proposal request (0-100)',
  `oldValue` json DEFAULT NULL COMMENT 'Lưu giá trị cũ, cấu trúc phụ thuộc vào loại đề xuất',
  `newValue` json DEFAULT NULL COMMENT 'Lưu giá trị mới, cấu trúc phụ thuộc vào loại đề xuất',
  `reason` text NOT NULL,
  `attachments` json DEFAULT NULL,
  `progressAtRequest` int NOT NULL DEFAULT '0' COMMENT 'Lưu % tại thời điểm đề xuất',
  `status` enum('Đang chờ','Đã phê duyệt','Đã từ chối') NOT NULL DEFAULT 'Đang chờ',
  `projectTaskId` varchar(36) DEFAULT NULL,
  `reasonReject` text,
  `delayReasons` json DEFAULT NULL COMMENT 'Lý do trễ hạn',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_fe41e560b186ba2c549d60672b` (`code`),
  KEY `FK_2dfaaeed356cb0ebcffc7e5a0c6` (`createdById`),
  KEY `FK_f2add3be18ffe0181205cf6daa1` (`updatedById`),
  KEY `FK_b82c439f2f6650cebc28c1db706` (`projectTaskId`),
  CONSTRAINT `FK_2dfaaeed356cb0ebcffc7e5a0c6` FOREIGN KEY (`createdById`) REFERENCES `user` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_b82c439f2f6650cebc28c1db706` FOREIGN KEY (`projectTaskId`) REFERENCES `project_task` (`id`) ON DELETE CASCADE,
  CONSTRAINT `FK_f2add3be18ffe0181205cf6daa1` FOREIGN KEY (`updatedById`) REFERENCES `user` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Lưu các đề xuất của project / task';
