DROP TABLE IF EXISTS `user_movement`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user_movement` (
  `id` varchar(36) NOT NULL,
  `createdById` varchar(36) DEFAULT NULL,
  `updatedById` varchar(36) DEFAULT NULL,
  `createdAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `deletedAt` timestamp(6) NULL DEFAULT NULL,
  `type` enum('Bổ nhiệm','Điều chuyển','Miễn nhiệm') NOT NULL,
  `oldValue` json DEFAULT NULL COMMENT 'Lưu giá trị cũ, ví dụ: chức danh cũ, đơn vị cũ, nghề nghiệp cũ',
  `newValue` json DEFAULT NULL COMMENT 'Lưu giá trị mới, ví dụ: chức danh cũ, đơn vị cũ, nghề nghiệp cũ',
  `reason` text NOT NULL COMMENT 'Lý do bổ nhiệm, điều chuyển, miễn nhiệm',
  `status` enum('Đang chờ','Đã phê duyệt','Đã từ chối','Xem') NOT NULL DEFAULT 'Đang chờ',
  `dateAppointment` timestamp NOT NULL COMMENT 'Ngày bổ nhiệm',
  `orgUnitId` varchar(36) DEFAULT NULL,
  `positionId` varchar(36) DEFAULT NULL,
  `userId` varchar(36) DEFAULT NULL,
  `reasonReject` text COMMENT 'Lý do từ chối khác',
  `rejectionReason` enum('Nhân sự không đáp ứng tiêu chuẩn vị trí','Hiệu suất làm việc của nhân sự không đạt yêu cầu','Nhân sự thiếu kỹ năng chuyên môn','Đề xuất trên vi phạm quy trình nội bộ','Không phù hợp với quy hoạch nhân sự','Không tuân thủ quy định pháp luật','Đề xuất gây ảnh hưởng đến hoạt động hiện tại của tổ chức','Không phù hợp với nhu cầu hiện tại','Tác động tiêu cực đến tinh thần đội ngũ','Đề xuất trên thiếu minh bạch','Đề xuất trên không đảm bảo công bằng','Thời điểm không phù hợp','Nhân sự chưa đủ thời gian đánh giá','Nhân sự có hành vi không phù hợp','Đề xuất trên gây xung đột lợi ích trong tổ chức') DEFAULT NULL COMMENT 'Lý do từ chối',
  PRIMARY KEY (`id`),
  KEY `FK_dc67c3b1adeaef87414b167ca81` (`createdById`),
  KEY `FK_e243f4c8a6d9205ab98d1af969b` (`updatedById`),
  KEY `FK_fdb5ca71ee7f022f169a9c6d17c` (`orgUnitId`),
  KEY `FK_91c9f59592c50c6c9ff9eb5eef5` (`positionId`),
  KEY `FK_df6a921a000c0ec2aac62c90018` (`userId`),
  CONSTRAINT `FK_91c9f59592c50c6c9ff9eb5eef5` FOREIGN KEY (`positionId`) REFERENCES `position` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_dc67c3b1adeaef87414b167ca81` FOREIGN KEY (`createdById`) REFERENCES `user` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_df6a921a000c0ec2aac62c90018` FOREIGN KEY (`userId`) REFERENCES `user` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_e243f4c8a6d9205ab98d1af969b` FOREIGN KEY (`updatedById`) REFERENCES `user` (`id`) ON DELETE SET NULL,
  CONSTRAINT `FK_fdb5ca71ee7f022f169a9c6d17c` FOREIGN KEY (`orgUnitId`) REFERENCES `org_unit` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Lưu thông tin bổ nhiệm của user với đơn vị, chức danh, nghề nghiệp';
/*!40101 SET character_set_client = @saved_cs_client */;

